INSERT INTO `catalog_product_entity_text` VALUES (2,85,0,2,'watch'),(3,76,0,2,'<p>Thức ăn bổ lông cho chó ANF Nature\'s Kitchen giàu axit béo, omega 3 (EPA+DHA) từ thành phần dầu cá hồi và cá tươi tự nhiên giúp làm mượt lông thú cưng. Axit béo trong hạt lanh giúp chăm sóc da và lông khỏe mạnh.</p>'),(4,75,0,2,'<p><strong>Thức ăn bổ lông cho chó ANF Nature\'s Kitchen</strong></p>\r\n<ul>\r\n<li>Thương hiệu: ANF</li>\r\n<li>Dòng sản phẩm: Nature\'s Kitchen</li>\r\n<li>Loại: <strong>Bổ lông, bổ da</strong></li>\r\n<li>Đối tượng: chó mọi lứa tuổi</li>\r\n<li>Khối lượng: 2 Kg</li>\r\n<li>Thành phần: gà nghiền khô, tăng trưởng cá hồi, đậu xanh, đậu lăng, men vi sinh, v.v.</li>\r\n<li>Công dụng: Giàu axit béo, omega 3 (EPA+DHA) từ thành phần dầu cá hồi và cá tươi tự nhiên giúp làm mượt lông thú cưng. Axit béo trong hạt lanh giúp chăm sóc da và lông khỏe mạnh.</li>\r\n</ul>'),(5,75,0,3,'<p><strong>Bánh thưởng cho chó Yaho hộp lớn</strong></p>\r\n<p> </p>\r\n<p>Thương hiệu Yaho</p>\r\n<p>Khối lượng 800 gram, gồm 6 gói bên trong, mỗi gói là một loại bánh thưởng khác nhau</p>\r\n<p>Là phần quà hấp dẫn dành cho các boss cưng của bạn, của người thân</p>\r\n<p>Bánh thưởng chứa nhiều dinh dưỡng và nhiều lợi ích: huấn luyện, thư giãn, làm sạch răng...</p>'),(6,85,0,3,'Bánh thưởng cho chó Yaho hộp lớn 800 gram (6 gói)'),(7,76,0,3,'<p>Bánh thưởng cho chó Yaho hộp lớn 800 gram có 6 gói bên trong, mỗi gói là một loại bánh thưởng khác nhau. Mua hộp lớn sẽ tiết kiệm hơn, boss thích hơn.</p>'),(8,75,0,4,'<p><strong>Pate cho chó Hug 400 gram</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: nhập khẩu Thái Lan chính hãng</li>\r\n<li>Dành cho chó từ 2 tháng tuổi</li>\r\n<li>Giúp cún ăn ngon miệng, thay đổi khẩu phần bữa ăn, điều trị biếng ăn, cung cấp dinh dưỡng hoàn hảo.</li>\r\n<li>Thành phần: Gà, thịt đỏ cá ngừ, tinh bột sắn biến tính, đạm đậu nành, các loại vitamin, các loại khoáng chất, dicalcium, titanium dioxide, xanhthan gum, bột thạch carrageenan base.</li>\r\n<li>Chỉ tiêu chất lượng: Độ ẩm 85%, Protein thô 7%, Xơ 1%, Khoáng 3%, Béo 5%</li>\r\n<li>Số tiêu chuẩn công bố: TCCS 05:2020/GOTG.HCM</li>\r\n<li>Bảo quản nhiệt độ phòng, để ngăn mát dùng trong 48 tiếng sau khi mở nắp</li>\r\n</ul>'),(9,85,0,4,'Pate cho chó Hug 400 gram'),(10,76,0,4,'<p>Pate cho chó Hug 400 gram nhập khẩu Thái Lan là dạng thức ăn hỗn hợp chứa nhiều đạm, protein, khoáng chất, vitamin... giúp cún cưng ăn ngon miệng, phát triển khỏe mạnh.</p>'),(11,75,0,5,'<p><strong>Sữa bột cho chó Dr.Kyan Predogen</strong></p>\r\n<p> </p>\r\n<p>Sản xuất tại Việt Nam</p>\r\n<p>Khối lượng 110 gram</p>\r\n<p>Dùng cho chó con, chó sơ sinh,  chó mẹ đang mang thai, chó ốm yếu, chó bệnh cần hồi phục sức khỏe</p>\r\n<p>Bảo vệ thận, Nano Calcium, chắc xương, mượt lông, tăng miễn dịch</p>\r\n<p>Sữa bột cho chó Dr.Kyan Predogen được sản xuất theo công thức Wonderlife Pharma của Mỹ, là một thực phẩm bổ dưỡng cho cún yêu của bạn ngoài thức ăn thông thường, giúp cún cảm thấy ngon miệng, bồi bổ cơ thể và cung cấp những dưỡng chất cần thiết để phát triển toàn diện.</p>\r\n<p>Hướng dẫn sử dụng: in trên hộp</p>\r\n<p>Bảo quản nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp</p>\r\n<p>Sữa đã pha có thể bảo quản ở ngắn mát tủ lạnh trong 24 tiếng</p>'),(12,85,0,5,'Sữa bột cho chó Dr.Kyan Predogen'),(13,76,0,5,'<div class=\"desc wb-content\">\r\n<p>Sữa bột cho chó Dr.Kyan Predogen được sản xuất theo công thức Wonderlife Pharma của Mỹ, là một thực phẩm bổ dưỡng cho cún yêu của bạn ngoài thức ăn thông thường, giúp cún cảm thấy ngon miệng, bồi bổ cơ thể...</p>\r\n</div>'),(14,75,0,6,'<p><strong>Thức ăn cho mèo con Catsrang Kitten 1.5 Kg</strong></p>\r\n<ul>\r\n<li>Thức ăn hạt cho mèo nhỏ Catsrang Kitten có nguồn gốc từ Hàn Quốc. Sản phẩm này áp dụng cho các chú mèo nhỏ, độ tuổi từ 4 đến 12 tháng. Cơ thể của các chú mèo lúc này yếu và cần nhiều chất như vitamin, chất khoáng, protein,...để cơ thể nhanh chóng phát triển cứng cáp.</li>\r\n<li>Catsrang Kitten giúp giải quyết một vấn đề vô cùng bất tiện mà hầu hết các chú mèo nhỏ đều gặp phải chính là vón lông ruột mèo. Vì cơ thể còn yếu, thiếu dưỡng chất nên bộ lông cũng chưa được mượt mà. Chính vì thế, các dưỡng chất cần thiết đã được bổ sung vào thức ăn để các bé mèo có thể tận hưởng thoải mái mà không lo còi xương, khó tiêu hay bị bết lông.</li>\r\n<li>Ngoài ra, ưu điểm nổi trội của loại sản phẩm này chính là tất cả các nguyên liệu đều được kiểm soát chặt chẽ. Không có chất bảo quản, chất kháng sinh, chất tạo mùi, tạo mùi hay hương liệu tổng hợp trong sản phẩm, Vì vậy, bạn có thể yên tâm sắm ngay một túi cho mèo cưng của mình nhé.</li>\r\n</ul>'),(15,85,0,6,'Thức ăn cho mèo con Catsrang Kitten 1.5 Kg'),(16,76,0,6,'<p>Thức ăn cho mèo con Catsrang Kitten có nguồn gốc từ Hàn Quốc. Sản phẩm này áp dụng cho các chú mèo nhỏ, độ tuổi từ 4 đến 12 tháng.</p>'),(17,75,0,7,'<p><strong>Bánh thưởng cho mèo Orgo</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Làm từ thành phẩn 100% tự nhiên, giàu dinh dưỡng, món ăn vặt yêu thích của tất cả mèo cưng</li>\r\n<li>Khối lượng 60 gram</li>\r\n<li>Loại: cá ngừ và gan gà</li>\r\n</ul>'),(18,85,0,7,'Bánh thưởng cho mèo Orgo 60 gram'),(19,76,0,7,'<p>Bánh thưởng cho mèo Orgo làm từ thành phẩn 100% tự nhiên, giàu dinh dưỡng, món ăn vặt yêu thích của tất cả mèo cưng.</p>'),(20,75,0,8,'<p><strong>Pate cho mèo Snappy Tom 400 gram</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: nhập khẩu Thái Lan chính hãng</li>\r\n<li>Dành cho mèo từ 2 tháng tuổi</li>\r\n<li>Giúp mèo ăn ngon miệng, thay đổi khẩu vị, điều trị biếng ăn, cung cấp dinh dưỡng hoàn chỉnh giúp mèo phát triển khỏe mạnh.</li>\r\n<li>Thành phần: Phụ phẩm gia cầm, bột gia cầm, cá ngừ, tinh bột kết dính, guar gum, Choline chloride, Calcium, taurin, Premix vitamin và khoáng chất.</li>\r\n<li>Số tiêu chuẩn công bố: TCCS 03:2019/GOTG.HCM</li>\r\n<li>Bảo quản nhiệt độ phòng, để ngăn mát và dùng hết trong 48 tiếng sau khi mở nắp</li>\r\n</ul>'),(21,85,0,8,'Pate cho mèo Snappy Tom 400 gram'),(22,76,0,8,'<p>Pate cho mèo Snappy Tom 400 gram là dạng thức ăn hỗn hợp hoàn chỉnh nhiều dinh dưỡng, đặc biệt thành phần Grain Free không ngũ cốc rất tốt cho sức khỏe mèo cưng của bạn.</p>'),(23,75,0,9,'<p><strong>Sữa cho mèo con Kitten Grow</strong></p>\r\n<p> </p>\r\n<p>Xuất xứ: Công ty Vedemin Việt Nam</p>\r\n<p>Khối lượng 100 gram / hộp</p>\r\n<p>Dùng được cho mèo từ 1 ngày tuổi, mèo mất mẹ, thiếu sữa</p>\r\n<p>Kitten Grow là sản phẩm sữa dinh dưỡng chứa các acid amin thiết yếu, cung cấp nguồn dinh dưỡng dễ tiêu hóa và hấp thu. Hỗ trợ cho sự tăng trưởng và phát triển khỏe mạnh của mèo con, mèo mất mẹ, chậm lớn, còi cọc.</p>\r\n<p>Cách dùng:</p>\r\n<p>Chuẩn bị nước ấm tỉ lệ 1 đun sôi + 1 nước nguội</p>\r\n<p>Khuấy đều đến khi tan hết sữa trong nước, cho mèo bú no. Ngày bú 1-2 lần.</p>\r\n<p>Liều lượng 25ml / 100 gram thể trọng / ngày</p>\r\n<p>Nếu dùng không hết có thể bảo quản ngăn mát tủ lạnh 24 tiếng, làm ấm lại trước khi cho mèo con uống.</p>'),(24,85,0,9,'Sữa cho mèo con Kitten Grow'),(25,76,0,9,'<p>Sữa cho mèo con Kitten Grow cung cấp nguồn dinh dưỡng dễ tiêu hóa, hấp thu. Bổ sung acid amin thiết yếu, giúp mèo con tăng trưởng và phát triển khỏe mạnh.</p>'),(26,75,0,10,'<p><strong>Thức ăn hạt khô cho chó vị cá hồi ANF Double Meat</strong></p>\r\n<p> </p>\r\n<p>Xuất xứ: Hàn Quốc</p>\r\n<p>Thích hợp cho chó cần nhiều dinh dưỡng phát triển, tuổi đang lớn, vừa khỏi bệnh...</p>\r\n<p>Thức ăn hạt gấp đôi thịt tươi cho chó vị cá hồi được chế biến từ 60% nguyên liệu thịt cá hồi tươi tự nhiên - nguồn protein dồi dào gấp đôi. So với sản phẩm thông thường khác, <strong>ANF Double Meat</strong> vị cá hồi có chứa nhiều hơn 40% chất chống oxy hóa tự nhiên giúp tăng cường hệ miễn dịch và giảm thiểu dị ứng cho thực phẩm gây ra. </p>\r\n<ul>\r\n<li>Giảm thiểu sự phá hủy các chất dinh dưỡng: với thành phần 60% thịt cá hồi tươi nguyên chất kích thích các bạn cún ăn ngon miệng và hệ tiêu hóa khỏe mạnh. Tỷ lệ thịt sống cao giúp giảm thiểu sự phá hủy các chất dinh dưỡng thiết yếu, từ đó tạo nên bữa ăn dinh dưỡng hơn cho thú cưng. </li>\r\n<li>Giàu protein: hàm lượng protein trong hạt sản phẩm cao hơn 30% nhờ sự kết hợp giữa protein động vật và thực vật. Giúp cân bằng chất dinh dưỡng và bổ sung protein mỗi ngày. </li>\r\n<li>Hạn chế tình trạng dị ứng thịt gà ở chó: Thịt gà là nguyên nhân chính gây ra tình trạng dị ứng thực phẩm ở chó. Sản phẩm ANF double meat đặc biệt nói KHÔNG với thành phần “thịt gà”</li>\r\n<li>Cân bằng omega 3 &amp; 6: tỷ lệ 1:4 từ cá hồi và hạt lanh hữu cơ giúp chăm sóc cho da và bộ lông khỏe mạnh.</li>\r\n</ul>'),(27,85,0,10,'Thức ăn hạt khô cho chó vị cá hồi ANF Double Meat 1.4 Kg'),(28,76,0,10,'<p>Thức ăn hạt khô cho chó vị cá hồi ANF Double Meat với gấp đôi thịt tươi cho chó được chế biến từ 60% nguyên liệu thịt cá hồi tươi tự nhiên, cung cấp nguồn protein dinh dưỡng gấp đôi.</p>'),(29,75,0,11,'<p><strong>Thức ăn hạt khô cho chó ANF 6 FREE vị cá hồi</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Khối lượng: 2 và 6 Kg</li>\r\n<li><strong>Dành cho chó từ 6 tháng tuổi</strong></li>\r\n<li>Với thành phần lên tới 95% nguyên liệu hữu cơ, thức ăn hạt cho chó ANF vị cá hồi đảm bảo an toàn cho sức khỏe cũng như hệ thần kinh của chó. </li>\r\n<li>Hạt ANF 6kg vị cá hồi so với các sản phẩm thông thường khác có chứa nhiều hơn 40% chất chống oxy hóa thiên nhiên giúp tăng cường hệ miễn dịch và giảm thiểu dị ứng do thực phẩm gây ra. </li>\r\n<li>Ngoài ra, sản phẩm cũng giúp cải thiện tỷ lệ hấp thụ thức ăn và hỗ trợ hệ tiêu hóa hoạt động hiệu quả hơn.</li>\r\n</ul>'),(30,85,0,11,'Thức ăn hạt khô cho chó ANF 6 FREE vị cá hồi'),(31,76,0,11,'<p>Thức ăn hạt khô cho chó ANF 6 FREE vị cá hồi với thành phần lên tới 95% nguyên liệu hữu cơ, đảm bảo an toàn cho sức khỏe cũng như hệ thần kinh của chó cưng.</p>'),(32,75,0,12,'<p><strong>Thức ăn hạt mềm cho chó ORIGI 7 thịt cừu</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Dùng cho chó mọi lứa tuổi</li>\r\n<li>Dành cho mọi giống chó thuộc mọi lứa tuổi</li>\r\n<li>Được chế biến từ 100% thịt thật </li>\r\n<li>70% nguyên liệu là hữu cơ, được chọn lọc theo tiêu chuẩn nghiêm ngặt từ nuôi trồng đến sản xuất và chế biến </li>\r\n<li>7 FREE: KHÔNG bột thịt, chất bảo quản hóa học, màu nhân tạo, bột ngọt, hương nhân tạo, hormone tăng trưởng, GMO </li>\r\n<li>Công thức đặc biệt với sự kết hợp của nghệ, mật ong, dừa và các lợi khuẩn đường ruột </li>\r\n<li>Ngăn ngừa dị ứng, nuôi dưỡng da khỏe và lông bóng mượt  </li>\r\n<li>Cải thiện hệ tiêu hóa, ngăn ngừa tiêu chảy  </li>\r\n<li>Tăng cường sức đề kháng, chống lão hóa</li>\r\n</ul>\r\n<p><strong>Công dụng của thịt cừu </strong></p>\r\n<p>Thức ăn hạt mềm hữu cơ thịt cừu Origi-7 sử dụng thịt cừu Úc tươi, cung cấp protein chất lượng cao cùng nhiều vitamin và khoáng chất, cải thiện chức năng cơ bắp và xương khớp. Ngoài ra, trong thịt cừu có chứa hàm lượng cao axit linoleic, giúp giảm khối lượng chất béo có tác động xấu đến sự chuyển hóa trong cơ thể. Từ đó, tăng cường sức đề kháng và hệ miễn dịch hiệu quả.</p>\r\n<p> </p>'),(33,85,0,12,'ORIGI'),(34,76,0,12,'<p>Thức ăn hạt mềm cho chó ORIGI 7 thịt cừu được làm từ thịt cừu Úc tươi ngon, chỉ sử dụng nguồn nguyên liệu hữu cơ sạch, an toàn, cung cấp đầy đủ dinh dưỡng cho thú cưng phát triển khỏe mạnh.</p>'),(35,75,0,13,'<p><strong>Thức ăn cho chó trưởng thành SmartHeart Gold</strong></p>\r\n<p> </p>\r\n<p>Xuất xứ Thái Lan</p>\r\n<p>Dành cho giống chó vừa và lớn, tuổi từ 12 tháng</p>\r\n<p>SmartHeart Gold là dòng sản phẩm thức ăn cao cấp của thương hiệu SmartHeart</p>\r\n<p>Được làm từ công thức đáp ứng yêu cầu dinh dưỡng dành cho chó trưởng thành của hiệp hội chăn nuôi Hoa Kỳ.</p>\r\n<p>Thành phần: ngủ cốc, thịt, bột thịt cừu, dầu thực vật, mỡ gà, dầu cá, cám gạo, protein từ thực vật, hạt lanh, củ cải đường, vitamin và khoáng chất</p>\r\n<p>Hướng dẫn sử dụng:</p>\r\n<p>- Nên cho cún ăn từ lượng ít và tăng dần khi hệ tiêu hóa thích nghi với thức ăn, tránh tiêu chảy hoặc rối loạn tiêu hóa.</p>\r\n<p>- Bảo quản thức ăn nơi khô ráo thoáng mát, tránh nắng trực tiếp</p>\r\n<p>- Bảo quản thức ăn trong túi kính hoặc hộp nhựa để giữ hương vị và tránh ẩm mốc</p>\r\n<p> </p>'),(36,85,0,13,'Thức ăn cho chó trưởng thành SmartHeart Gold'),(37,76,0,13,'<p>Thức ăn cho chó trưởng thành SmartHeart Gold là thức ăn hạt cho giống chó vừa và lớn (medium và large breed) có tuổi từ 12 tháng trở lên.</p>'),(38,75,0,14,'<p><strong>Thức ăn chó con giống lớn Pro Pac Lagre Breed Puppy</strong></p>\r\n<p>Được chế biến một cách khoa học cho chó con những giống lớn như: Alaska, Samoyed, Golden, Husky... có cân nặng khi trưởng thành trên 22 Kg.</p>\r\n<ul>\r\n<li>Xuất xứ: Mỹ</li>\r\n<li>Khối lượng: 2.5 Kg</li>\r\n<li>Dành cho chó con (giống loài lớn)</li>\r\n</ul>\r\n<p><strong>Đặc điểm nổi bật:</strong></p>\r\n<ul>\r\n<li>DHA giúp não bộ và mắt khỏe mạnh. Ngoài ra, tỷ lệ cân bằng giữa canxi và phốt pho giúp kiểm soát tốc độ tăng trưởng ổn định, tránh các vấn đề về khớp và xương thông thường.</li>\r\n<li>Không có chất gây dị ứng thông  thường như ngô, lúa mì hoặc đậu nành. Vì vậy đây là lựa chọn tuyệt vời cho thú cưng có độ nhạy cảm cao.</li>\r\n<li>Bột thịt gà thượng hạng là thành phần chính được cân bằng axit béo omega  –  hỗ trợ cho da, lông và hệ miễn dịch khỏe mạnh. Được bổ sung thêm L-Carnitine  giúp thú cưng của bạn đốt cháy chất béo và duy trì khối lượng cơ nạc.</li>\r\n<li>Chất chống oxy hóa + chất xơ từ củ cải đường, việt quất và nam việt quất đóng một vai trò quan trọng đối với sức khỏe lâu dài và hỗ trợ đường tiêu hóa khỏe mạnh. Các khoáng chất được kết hợp với nhau một cách hoàn hảo giúp thú cưng hấp thụ cao hơn các chất dinh dưỡng quan trọng này.</li>\r\n</ul>'),(39,85,0,14,'Thức ăn chó con giống lớn Pro Pac Lagre Breed Puppy 2.5 KG'),(40,76,0,14,'<p>Thức ăn chó con giống lớn Pro Pac Lagre Breed Puppy được chế biến một cách khoa học cho chó con những giống lớn như: Alaska, Samoyed, Golden, Husky... có cân nặng khi trưởng thành trên 22 Kg.</p>'),(41,75,0,15,'<p><strong>Thức ăn chó con Royal Canin Maxi Puppy</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Pháp</li>\r\n<li>Dành cho chó con dưới 12 tháng tuổi</li>\r\n<li>Các giống chó có thể trọng trên 25kg khi trưởng thành như: Alaska, Becgie, Rottweiler, Pitbull...</li>\r\n<li>Giúp bổ sung canxi cho cún phát triển tối đa khung xương và trọng lượng cơ thể</li>\r\n</ul>\r\n<p><strong>LỢI ÍCH</strong></p>\r\n<ul>\r\n<li>\r\n<p><strong>Hệ tiêu hóa khỏe mạnh:</strong> Sự kết hợp độc đáo của các chất dinh dưỡng để hỗ trợ tiêu hóa với các protein tiêu hóa cao (LIP) và sự cân bằng đường ruột cùng với hệ dưỡng chất hỗ trợ phát triển hệ bài tiết.</p>\r\n</li>\r\n<li>\r\n<p><strong>Tăng trưởng dài - Năng lượng trung bình: </strong>Đáp ứng nhu cầu năng lượng vừa phải của giống chó lớn có chu kỳ phát triển dài.</p>\r\n</li>\r\n<li>\r\n<p><strong>Sức khoẻ xương</strong> <strong>và khớp: </strong>Năng lượng cân bằng và các khoáng chất (canxi và phốt pho) góp phần hỗ trợ cho xương và khớp khỏe mạnh.</p>\r\n</li>\r\n<li>\r\n<p><strong>Bảo vệ tự nhiên: </strong>Với hợp chất chống oxy hóa đặc biệt từ ROYAL CANIN giúp bảo vệ tự nhiên với giống chó size maxi.</p>\r\n</li>\r\n<li>\r\n<p><strong>Thiết kế hạt thức ăn cho chó ROYAL CANIN: </strong>Hạt được thiết kế đặc biệt cho giống chó size Maxi để khuyến khích nhai, từ đó giảm công việc cho hệ tiêu hóa</p>\r\n</li>\r\n</ul>'),(42,85,0,15,'Thức ăn chó con Royal Canin Maxi Puppy'),(43,76,0,15,'<p>Thức ăn chó con Royal Canin Maxi Puppy dành cho chó con dưới 12 tháng tuổi, thuộc các giống chó lớn có cân nặng trên 25 kg khi trưởng thành.</p>'),(44,75,0,16,'<p><strong>Thức ăn hạt cho chó trưởng thành nhập khẩu Canada Nutrience Original (Cao cấp)</strong></p>\r\n<ul>\r\n<li>Thương hiệu: <strong>Nutrience</strong>, sản xuất và kiểm định tại Canada, được cấp phép xuất khẩu toàn cầu vào những thị trường khó tính nhất: Mỹ, Pháp, Châu Âu...</li>\r\n<li>Loại: <strong>Original</strong></li>\r\n<li>Thành phần: Bột thịt cừu Canada, lúa mạch, bột yến mạch, đậu Hà Lan, gạo lứt, bột thịt gà, mỡ gà (được bảo quản bằng hỗn hợp tocopherols – nhóm chất quan trọng có trong Vitamin E), bột củ cải khô, hương vị thịt cừu tự nhiên, hạt lanh, men bia, kali clorua, dầu cá hồi (nguồn DHA), quả việt quất, quả nam việt quất, cà rốt.</li>\r\n<li><strong>Chất lượng đạt tiêu chuẩn 5 sao trên toàn thế giới</strong></li>\r\n<li>Cung cấp bữa ăn đầy đủ mọi dinh dưỡng và năng lượng cần thiết cho chó trưởng thành (Từ 12 tháng tuổi)</li>\r\n<li>Không gây tác dụng phụ, không bị sỏi thận</li>\r\n</ul>\r\n<p> </p>\r\n<p>Thịt cừu là nguyên liệu số 1 trong thức ăn, mang đến cho chú chó cưng của bạn hương vị yêu thích và hỗ trợ phát triển cơ thể năng động khỏe mạnh.</p>\r\n<ul>\r\n<li><strong>Cơ bắp phát triển khỏe mạnh:</strong> Nguyên liệu số 1 trong công thức dinh dưỡng của Nutrience luôn luôn là thịt cừu chất lượng cao giúp chú chó đáng yêu của bạn duy trì cơ bắp dẻo dai. Nutrience không bao giờ sử dụng những nguyên liệu kém chất lượng như meat-by-product (phụ phẩm từ thịt) hay đạm thực vật để tăng hàm lượng đạm trong các sản phẩm của mình</li>\r\n<li><strong>Hệ miễn dịch khỏe mạnh:</strong> Nutrience Original sử dụng nhiều nguồn nguyên liệu tự nhiên có chứa chất chống oxy hóa cho các công thức dinh dưỡng (quả việt quất, nam việt quất và cà rốt cùng với vitamin C và vitamin E) để chúng hoạt động cùng nhau hỗ trợ phát triển hệ miễn dịch của chú chó cưng của bạn.</li>\r\n<li><strong>Hệ tiêu hóa khỏe mạnh:</strong> Sức khỏe tiêu hóa có liên kết trực tiếp đến sức khỏe tổng thể của thú cưng của bạn. Công thức của Nutrience bao gồm một sự kết hợp của ngũ cốc nguyên hạt, chất xơ tự nhiên và prebiotics để giúp chó cưng của bạn duy trì đường ruột khỏe mạnh.</li>\r\n<li><strong>Da và lông khỏe mạnh:</strong> Bộ da và lông của một chú chó sẽ phản ánh tổng thể sức khỏe của chúng. Nguồn cung cấp axit béo tự nhiên Omega 3 và Omega 6, bao gồm dầu cá hồi và hạt lanh, sẽ giúp chú chó cưng của bạn duy trì da lông một cách khỏe mạnh và sáng bóng.</li>\r\n<li><strong>Hỗ trợ xương và khớp:</strong> Kích thước của chó càng lớn thì áp lực sẽ lớn hơn đối với xương khớp của chúng. Thương hiệu đến từ Canada luôn đảm bảo lượng Glucosamin và Chondroitin cần thiết trong công thức dinh dưỡng của chúng tôi để hỗ trợ xương khớp và sự linh động cho chú chó cưng của bạn.</li>\r\n</ul>'),(45,85,0,16,'Thức ăn hạt cho chó trưởng thành Nutrience Original (5 Kg)'),(46,76,0,16,'<div class=\"desc wb-content\">\r\n<p>Thức ăn hạt cho chó trưởng thành nhập khẩu Canada Nutrience Original. Thích hợp cho chó trên 12 tháng tuổi có nhu cầu dinh dưỡng cao, phát triển sức khỏe và vóc dáng tối đa.</p>\r\n</div>'),(47,75,0,17,'<p><strong>Thức ăn chó con SmartHeart Puppy</strong></p>\r\n<p> </p>\r\n<p>Xuất xứ Thái Lan</p>\r\n<p>Dành cho chó con dưới 1 năm tuổi</p>\r\n<p>Chó con sẽ có giai đoạn phát triển nhanh nhất trong vòng 1 năm đầu tiên. Dinh dưỡng cân bằng và đầy đủ là yếu tố cần thiết cho sự phát triển khỏe mạnh, ổn định.</p>\r\n<p>Thức ăn SmartHeart Puppy có thể đáp ứng tất cả nhu cầu dinh dưỡng của cún con từ 2 tháng - 12 tháng tuổi.</p>\r\n<p>Thành phần: gạo, bột gia cầm, bột đậu nành, dầu cá, hương vị thịt bò nướng, vitamin, khoáng chất.</p>\r\n<p>Hướng dẫn sử dụng:</p>\r\n<p>- Nên cho cún ăn từ lượng ít và tăng dần khi hệ tiêu hóa thích nghi với thức ăn, tránh tiêu chảy hoặc rối loạn tiêu hóa.</p>\r\n<p>- Có thể ngâm nước với tỉ lệ 3 thức ăn : 1 nước để cún dễ ăn hơn</p>\r\n<p>- Bảo quản thức ăn nơi khô ráo thoáng mát, tránh nắng trực tiếp</p>\r\n<p>- Bảo quản thức ăn trong túi kính hoặc hộp nhựa để giữ hương vị và tránh ẩm mốc</p>'),(48,85,0,17,'Thức ăn chó con SmartHeart Puppy'),(49,76,0,17,'<div class=\"desc wb-content\">\r\n<p>Thức ăn chó con SmartHeart Puppy có thể đáp ứng đầy đủ nhu cầu dinh dưỡng cần thiết cho cún con dưới 1 năm tuổi.</p>\r\n</div>'),(50,75,0,18,'<p><strong>Thức ăn Ideal Recipe Skin &amp; Coat hỗ trợ da lông</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Công ty sản xuất Jeil Food</li>\r\n<li>Dinh dưỡng hoàn chỉnh từ 100% nguyên liệu tự nhiên</li>\r\n<li>Thành phần lý tưởng: từ đậu nành thủy phân, nhuyễn thể thủy phân và cá hồi thủy phân</li>\r\n<li>Công nghệ sản xuất hiện đại từ Đức </li>\r\n<li>Hỗ trợ hệ tiêu hóa khỏe mạnh từ thành phần Probiotics và prebiotics</li>\r\n<li>Axit béo Omega 3 &amp; 6 từ cá hồi tự nhiên giúp da và lông óng mượt </li>\r\n<li>Kháng viêm, giảm đau xương khớp nhờ thành phần Methyl Sulfonyl Methane (MSM) </li>\r\n<li>Chiết xuất cây Yucca làm giảm mùi hôi do phân thải ra. t</li>\r\n<li>Chiết xuất cây kế sữa ( Milk thistle) giúp bảo vệ gan và các vấn đề liên quan đến túi mật thú cưng. </li>\r\n<li>Ngăn ngừa lão hóa từ thành phần trái cây, rau củ và thảo mộc tự nhiên</li>\r\n<li>Taurine giúp sáng mắt và trái tim khỏe mạnh hơn.</li>\r\n</ul>'),(51,85,0,18,'Thức ăn Ideal Recipe Skin & Coat hỗ trợ da lông'),(52,76,0,18,'<p>Thức ăn Ideal Recipe Skin &amp; Coat chứa công thức dinh dưỡng lý tưởng hỗ trợ tốt cho da và lông chó trưởng thành từ 12 tháng tuổi.</p>'),(53,75,0,19,'<p><strong>Xương gặm cho chó nhiều vị Orgo 90 gram</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Giúp làm sạch răng tự nhiên</li>\r\n<li>Bổ sung canxi hiệu quả</li>\r\n<li>Món ăn vặt giúp cún cưng đỡ buồn</li>\r\n</ul>'),(54,85,0,19,'Xương gặm cho chó nhiều vị Orgo 90 gram'),(55,76,0,19,'<div class=\"desc wb-content\">\r\n<p>Xương gặm cho chó nhiều vị Orgo là món ăn vặt thích thú của cún cưng và giúp bổ sung canxi hiệu quả.</p>\r\n</div>'),(56,75,0,20,'<p><strong>Que gặm cho chó khỏe răng 7 Dental Effects</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Giúp làm sạch và khỏe răng cho cún cưng, ngoài ra đây là món bánh chứa nhiều dinh dưỡng bổ sung.</li>\r\n<li>Một gói chứa 1 que</li>\r\n<li>Vị bò, bắp, bơ</li>\r\n</ul>'),(57,85,0,20,'Que gặm cho chó khỏe răng 7 Dental Effects 11 gram'),(58,76,0,20,'<div class=\"desc wb-content\">\r\n<p>Que gặm cho chó khỏe răng 7 Dental Effects giúp làm sạch và khỏe răng cho cún cưng, ngoài ra đây là món bánh chứa nhiều dinh dưỡng bổ sung.</p>\r\n</div>'),(59,75,0,21,'<p><strong>Bánh thưởng cho chó Yaho Dog Chew</strong></p>\r\n<p> </p>\r\n<p>Thương hiệu Yaho</p>\r\n<p>Khối lượng 220 gram, khoảng 60 viên hình xương</p>\r\n<p>Đóng gói dạng hộp sang trọng, dễ bảo quản</p>\r\n<p>Mùi vị thịt thơm ngon, bổ dưỡng</p>\r\n<p>Giúp răng cún sạch và khỏe hơn</p>\r\n<p>Có thể dùng để làm phần thưởng huấn luyện cún nghe lời</p>'),(60,85,0,21,'Bánh thưởng cho chó Yaho Dog Chew'),(61,76,0,21,'<p>Bánh thưởng cho chó Yaho Dog Chew dạng viên mềm hình chiếc xương với nhiều vị thịt bò, gà, sữa thơm ngon, nhiều dinh dưỡng, giúp răng cún chắc khỏe, sạch răng.</p>'),(62,85,0,22,'Xương gặm loại to Yaho 162 gram'),(63,75,0,22,'<p><strong>Xương gặm loại to Yaho 162 gram</strong></p>\r\n<p> </p>\r\n<p>Thương hiệu Yaho</p>\r\n<p>Khối lượng 1 thanh xương to 162gram, dài khoảng 20cm</p>\r\n<p>Thích hợp cho cún lớn từ 15 kg trở lên</p>\r\n<p>Gặm xương giúp răng cún sạch hơn, răng chắc khỏe, loại bỏ mảng bám tự nhiên, không còn ngứa răng cắn phá đồ trong nhà.</p>'),(64,76,0,22,'<p>Xương gặm loại to Yaho, gói có 1 thanh xương to, nặng 162gram, dài khoảng 20cm, thích hợp cho các loại chó lớn gặm được lâu dài.</p>'),(65,75,0,23,'<p><strong>Gà cuộn xương sữa Yaho 100 gram</strong></p>\r\n<p> </p>\r\n<p>Thương hiệu Yaho</p>\r\n<p>Khối lượng 100 gram, có khoảng 11-12 thanh xương cuộn</p>\r\n<p>Mùi vị thơm ngon, thịt gà cuộn xương nhiều dinh dưỡng cho cún</p>\r\n<p>Dùng được cho mọi loại chó từ 2 tháng tuổi trở lên</p>\r\n<p>Món ăn vặt yêu thích, giúp cún thư giãn, xả stress, chống ngứa răng...</p>'),(66,85,0,23,'Gà cuộn xương sữa Yaho 100 gram'),(67,76,0,23,'<p>Gà cuộn xương sữa Yaho 100 gram, gói màu vàng, bên trong có khoảng 11-13 thanh gà cuộn xương thơm phức, món ăn vặt nhiều dinh dưỡng yêu thích của cún cưng.</p>'),(68,75,0,24,'<p><strong>Bánh gặm cho chó 7 Dental Effects</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Mỗi gói gồm 5 cây bánh snack với các vị khác nhau, chứa nhiều dinh dưỡng và làm sạch răng tự nhiên cho cún</li>\r\n<li>Giúp khử mùi hôi từ hơi thở của cún</li>\r\n<li>Rèn luyện răng chắc khỏe</li>\r\n<li>Khối lượng 100 gram/gói</li>\r\n</ul>'),(69,85,0,24,'Bánh gặm cho chó 7 Dental Effects 100 gram'),(70,76,0,24,'<p>Bánh gặm cho chó 7 Dental Effects, mỗi gói gồm 5 cây bánh snack với các vị khác nhau, chứa nhiều dinh dưỡng và làm sạch răng tự nhiên cho cún.</p>'),(71,75,0,25,'<p><strong>Bánh thưởng cho chó Orgo Biscuit 55 gram</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Món ăn vặt nhiều dinh dưỡng</li>\r\n<li>Làm phần thưởng khi cún hoàn thành nhiệm vụ</li>\r\n<li>Vị trà xanh, vị bò</li>\r\n</ul>'),(72,85,0,25,'Bánh thưởng cho chó Orgo Biscuit 55 gram'),(73,76,0,25,'<div class=\"desc wb-content\">\r\n<p>Bánh thưởng cho chó Orgo Biscuit với hai vị trà xanh và bò, đây là món ăn vặt bổ dưỡng giúp cún cưng khỏe mạnh hơn.</p>\r\n</div>'),(74,85,0,26,'Thịt cuộn thanh sữa cho chó BowWow'),(75,76,0,26,'<p>Thịt cuộn thanh sữa cho chó BowWow được làm từ thịt thật và sữa, chứa nhiều vitamin và khoáng chất, giúp hỗ trợ việc huấn luyện chó và nâng cao khả năng học hỏi của chó.</p>'),(76,75,0,26,'<p><strong>Thịt cuộn thanh sữa cho chó BowWow</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Khối lượng: 80 gram</li>\r\n<li>Loại thịt: heo / gà / vịt</li>\r\n</ul>\r\n<p> </p>\r\n<p>Được làm từ thịt thật và sữa, chứa nhiều vitamin và khoáng chất, giúp hỗ trợ việc huấn luyện chó và nâng cao khả năng học hỏi của chó. Sản phẩm có dạng mềm, thơm ngon, có hàm lượng chất béo, muối và calo thấp.</p>\r\n<ul>\r\n<li>Dành cho mọi giống chó thuộc mọi lứa tuổi, cân nặng</li>\r\n<li>Thành phần: thịt heo, cá ngừ, bột mì, bột đậu nành, gia vị, vitamin, khoáng chất</li>\r\n<li>Hương vị thịt và sữa thơm ngon</li>\r\n<li>Chứa nhiều vitamin và khoáng chất</li>\r\n<li>Được sản xuất với những tiêu chuẩn vệ sinh hàng đầu</li>\r\n<li>Thích hợp trong việc huấn luyện và làm bánh thưởng cho chó</li>\r\n<li>Không có hại cho tim và thận nhờ lượng muối thấp</li>\r\n<li>Vệ sinh an toàn, đã được tiệt trùng ở nhiệt độ cao</li>\r\n</ul>'),(77,75,0,27,'<p><strong>Xúc xích phô mai cho chó BowWow</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Khối lượng: 50 gram</li>\r\n<li>Dành cho chó mọi lứa tuổi, cân nặng</li>\r\n</ul>\r\n<h4><strong>Đặc điểm nổi bật </strong></h4>\r\n<p>Xúc xích phô mai Bowwow với hương vị đặc biệt thơm ngon, không chứa chất bảo quản, là món ăn nhẹ bổ dưỡng được cả chó và mèo yêu thích. Ngoài những bữa ăn chính hàng ngày, đây còn là thực phẩm bổ sung giúp việc huấn luyện thú cưng dễ dàng và hiệu quả hơn.</p>\r\n<ul>\r\n<li>Thơm ngon, bổ dưỡng</li>\r\n<li>Giúp xương chắc khỏe</li>\r\n<li>Hỗ trợ hệ tiêu hóa, tim mạch</li>\r\n<li>Không chứa chất bảo quản</li>\r\n<li>Dùng được cho cả chó và mèo</li>\r\n<li>Không có hại cho tim và thận nhờ lượng muối thấp</li>\r\n<li>Thành phần: Thịt cá, bột lúa mì, phô mai, trứng, sorbitol, muối, đạm đậu nành, đường, Lecithin, bột phô mai</li>\r\n</ul>'),(78,85,0,27,'Xúc xích phô mai cho chó BowWow'),(79,76,0,27,'<p>Xúc xích phô mai cho chó BowWow với hương vị đặc biệt thơm ngon, không chứa chất bảo quản, là món ăn nhẹ bổ dưỡng được cả chó và mèo yêu thích.</p>'),(80,75,0,28,'<p><strong>Pate cho chó SmartHeart 400 gram</strong></p>\r\n<p> </p>\r\n<p>Xuất xứ Thái Lan</p>\r\n<p>Khối lượng 400 gram</p>\r\n<p>Dành cho chó từ 2 tháng tuổi</p>\r\n<p>Pate là món ăn thơm ngon mà mọi chú chó đều thích, giúp chó ăn ngon miệng, hạn chế biếng ăn, cung cấp đầy đủ dinh dưỡng cần thiết mỗi ngày.</p>\r\n<p>Tiện dụng khi ba mẹ không có thời gian chuẩn bị bữa ăn, khi đi du lịch...</p>\r\n<p>Hướng dẫn sử dụng:</p>\r\n<p>- Khui nắp hộp, cho cún ăn trực tiếp hoặc trộn vào khẩu phần ăn thường ngày của cún.</p>\r\n<p>- Nên bảo quản bằng ngăn mát sau khi mở hộp thức ăn và dùng hết trong 48 tiếng.</p>\r\n<p> </p>'),(81,85,0,28,'Pate cho chó SmartHeart 400 gram'),(82,76,0,28,'<p>Pate cho chó SmartHeart dạng lon 400 gram là món ăn dinh dưỡng hoàn chỉnh dành cho mọi loại chó, mọi kích cỡ, tuổi từ 2 tháng trở lên.</p>'),(83,75,0,29,'<p><strong>Sốt dinh dưỡng cho chó SmartHeart 130gr</strong></p>\r\n<p> </p>\r\n<p>Xuất xứ Thái Lan</p>\r\n<p>Khối lượng 130 gram</p>\r\n<p>Dạng túi nhỏ, thức ăn ướt, có thể trộn vào khẩu phần ăn thường ngày của cún, giúp cún ăn ngon miệng và đầy đủ dinh dưỡng.</p>\r\n<p>Thức ăn SmartHeart dạng túi với công thức hoàn chỉnh từ nguồn thịt tươi chất lượng, giúp giữ nguyên hương vị thơm ngon và tăng cường sức khỏe cho cún.</p>\r\n<p>Hướng dẫn sử dụng:</p>\r\n<p>- Xé bịch, cho ăn trực tiếp hoặc trộn vào khẩu phần ăn thường ngày của chó</p>\r\n<p>- Nên bảo quản bằng ngăn mát sau khi mở túi thức ăn và dùng hết trong 48 tiếng.</p>'),(84,85,0,29,'Sốt dinh dưỡng cho chó SmartHeart 130gr'),(85,76,0,29,'<p>Sốt dinh dưỡng cho chó SmartHeart 130gr là dạng thức ăn ướt đóng gói nhỏ phù hợp với 1-2 lần ăn của chó. Cung cấp bữa ăn hoàn chỉnh, cân bằng dinh dưỡng cho cún cưng của bạn.</p>'),(86,75,0,30,'<p><strong>Pate cho chó mèo King Pet 380 gram</strong></p>\r\n<p>Với sứ mệnh nâng cao sức khỏe cho thú cưng tại Việt Nam, thức ăn hỗn hợp hoàn chỉnh dạng pate King Pet là một sản phẩm sáng tạo mới của Công Ty TNHH TMDV Thú Cưng Việt Nam, dành cho chó mèo trên 1 tháng tuổi.</p>\r\n<p>Sản xuất theo TCCS: 1213:2018/PETVN công bố tại Cục Chăn nuôi - Bộ NN&amp;PTNT. Sản phẩm đã được hợp pháp hoá và cấp phép lưu hành tại VN, hoá đơn đỏ điện tử, giấy xét nghiệm chứng nhận của Vinacert, sản xuất tại nhà máy đạt tiêu chuẩn ISO9001:2015 và HACCP.</p>\r\n<ul>\r\n<li>Nguyên liệu tự nhiên: Sử dụng nguồn thịt và gan gà tươi xuất xứ hoàn toàn Việt Nam, không sử dụng chất độn, chất tạo dày. Kết cấu hoàn toàn từ nguyên liệu thật xay nhuyễn.</li>\r\n<li> Hương vị thơm ngon: Sản phẩm là phiên bản thay thế hoàn hảo cho khách hàng cần sử dụng Pate tươi với định lượng nhỏ, cần bảo quản lâu, di chuyển xa…</li>\r\n<li>Siêu cấp nước cho hệ tiêu hóa: Cho thú cưng sử dụng thức ăn ướt là giúp ngăn ngừa sỏi thận do thói quen sử dụng thức ăn khô &amp; lười uống nước.</li>\r\n<li>Đầy đủ vitamin, khoáng chất cần thiết: Giàu vitamin A, E, nhóm B, sắt, phosphorus, magie, canxi… từ thịt và gan gà tươi nguyên chất giúp cho chó mèo sáng mắt, khỏe xương, phát triển bền vững.</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>CHỈ TIÊU CHẤT LƯỢNG</strong></p>\r\n<p>Hàm lượng dinh dưỡng: tối thiểu 1800 Kcal/Kg, đạm thô: tối thiểu 18%, độ ẩm tối đa: 65%, chất béo thô: tối thiểu 10%.   <br />Tiêu chuẩn cơ sở &amp; chỉ tiêu chất lượng được lập bởi Công ty CP Chứng nhận và Giám định Vinacert – đã được Cục chăn nuôi cấp phép.</p>'),(87,85,0,30,'Pate cho chó mèo King Pet 380 gram (Gà)'),(88,76,0,30,'<p>Pate cho chó mèo King Pet là sản phẩm tươi ngon, không chất bảo quản. Được sản xuất từ nguồn thịt và gan gà tươi, là món ăn bổ dưỡng, yêu thích cho chó mèo trên 1 tháng tuổi.</p>'),(89,75,0,31,'<p><strong>Pate cho chó Hug 120 gram</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: nhập khẩu Thái Lan chính hãng</li>\r\n<li>Dành cho chó từ 2 tháng tuổi</li>\r\n<li>Giúp cún ăn ngon miệng, thay đổi khẩu phần bữa ăn, điều trị biếng ăn, cung cấp dinh dưỡng hoàn hảo.</li>\r\n<li>Thành phần: Thịt gà/cừu, thịt đỏ cá ngừ, cà rốt, gan cừu/gà, tinh bột sắn biến tính, đạm đậu nành, các loại vitamin, các loại khoáng chất, dicalcium, titanium dioxide, xanhthan gum, bột thạch carrageenan base.</li>\r\n<li>Chỉ tiêu chất lượng: Độ ẩm 85%, Protein thô 6%, Xơ 1%, Khoáng 3%, Béo 4%</li>\r\n<li>Số tiêu chuẩn công bố: TCCS 03:2020/GOTG.HCM</li>\r\n<li>Bảo quản nhiệt độ phòng, để ngăn mát dùng trong 24 tiếng sau khi mở túi</li>\r\n</ul>'),(90,85,0,31,'Pate cho chó Hug 120 gram'),(91,76,0,31,'<p>Pate cho chó Hug 120 gram là dạng thức ăn hỗn hợp hoành chỉnh nhiều dinh dưỡng, hương vị thơm ngon... giúp cún cưng ăn ngon miệng, phát triển khỏe mạnh, không còn biếng ăn.</p>'),(92,75,0,32,'<p><strong>Pate cho chó Jerhigh Thái Lan</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ Thái Lan</li>\r\n<li>Khối lượng 120gram</li>\r\n<li>Thành phần: thịt tươi, rau củ, trái cây giàu protein</li>\r\n<li>Cung cấp dinh dưỡng hằng ngày cho cún yêu của bạn phát triển khỏe mạnh</li>\r\n<li>Là món ăn ngon giúp thay đổi khẩu vị, khắc phục tình trạng biếng ăn ở chó.</li>\r\n</ul>'),(93,85,0,32,'Pate cho chó Jerhigh Thái Lan'),(94,76,0,32,'<p>Pate cho chó Jerhigh nhập khẩu Thái Lan là một dạng sốt làm từ thịt tươi và rau củ, cung cấp nguồn dinh dưỡng dồi dào cho cún cưng của bạn.</p>'),(95,75,0,33,'<p><strong>Pate cho chó Monge</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Italy</li>\r\n<li>Khối lượng: 100 gram</li>\r\n<li>Thức ăn ướt bổ dưỡng, thơm ngon dành cho tất cả giống chó</li>\r\n</ul>'),(96,85,0,33,'Pate cho chó Monge hàng nhập khẩu Italy (100gram)'),(97,76,0,33,'<p>Pate cho chó Monge hàng nhập khẩu từ Italy, với nhiều loại mùi vị thành phần khác nhau. Đây là món ăn chứa nhiều dinh dưỡng giúp cún cưng phát triển khỏe mạnh.</p>'),(98,75,0,34,'<p><strong>Xúc xích cho chó Bioline</strong></p>\r\n<p> </p>\r\n<p>Thương hiệu Bioline</p>\r\n<p>Khối lượng 450 gram/gói</p>\r\n<p>Một gói có 30 cây, mỗi cây 15 gram</p>\r\n<p>Dùng cho mọi loại chó từ 2 tháng tuổi</p>\r\n<p>Là món ăn yêu thích chứa nhiều dinh dưỡng dành cho mọi chú cún</p>\r\n<p>Có thể cho ăn vặt, ăn kèm bữa chính hoặc làm bánh thưởng.</p>'),(99,85,0,34,'Xúc xích cho chó Bioline (30 que)'),(100,76,0,34,'<p>Xúc xích cho chó Bioline là món ăn yêu thích của tất cả chú chó, thành phần dinh dưỡng cao, mùi vị thơm ngon, là phần thưởng tuyệt vời cho cún cưng của bạn.</p>'),(101,75,0,35,'<p><strong>Sữa cho chó con Pet Grow</strong></p>\r\n<p> </p>\r\n<p>Xuất xứ: Công ty Vedemin Việt Nam</p>\r\n<p>Khối lượng 200 gram</p>\r\n<p>Dùng được cho chó con từ 1 ngày tuổi, chó mất mẹ, còi cọc, chậm lớn</p>\r\n<p>Pet Grow là sản phẩm dinh dưỡng chứa các acid amin thiết yếu cung cấp nguồn dưỡng chất cần thiết hằng ngày cho cún con. Giúp cún con dễ tiêu hóa, dễ hấp thụ, hỗ trợ cho sự phát triển của cún con.</p>\r\n<p>Cách dùng:</p>\r\n<p>Pha sữa với tỉ lệ 1 sữa : 2 nước ấm (nước ấm tỉ lệ = 1 nước đun sôi + 1 nước nguội)</p>\r\n<p>Khuấy đều đến khi sữa tan hoàn toàn trong nước</p>\r\n<p>Mỗi ngày cho bú no 4-5 lần. Liều lượng 23ml / 100 gram thể trọng / ngày</p>\r\n<p>Nên pha lượng vừa phải và dùng hết trong vòng 24 tiếng, bảo quản ngăn mát, làm ấm lại trước khi cho cún uống.</p>'),(102,85,0,35,'Sữa cho chó con Pet Grow'),(103,76,0,35,'<div class=\"desc wb-content\">\r\n<p>Sữa cho chó con Pet Grow là sản phẩm dinh dưỡng chứa các acid amin thiết yếu, cung cấp nguồn dinh dưỡng dễ tiêu hóa, dễ hấp thụ, hỗ trợ cho sự phát triển của chó con từ 1 ngày tuổi.</p>\r\n</div>'),(104,75,0,36,'<p><strong>Sữa cho chó con, chó mẹ Esbilac</strong></p>\r\n<ul>\r\n<li>Xuất xứ: Mỹ</li>\r\n<li>Dạng bột, dùng cho chó con nhỏ hơn 6 tuần tuổi, chó con mất mẹ, chó mẹ đang mang thai, chó mẹ đang nuôi con</li>\r\n<li>Dễ dàng tiêu hóa, thơm ngon được các bé cún yêu thích</li>\r\n<li>Chứa rất nhiều Prebiotic và Probiotic giúp tăng cường hệ miễn dịch cho chó con</li>\r\n<li>Giúp chó mẹ có đầy đủ dinh dưỡng nuôi con khi mang thai hoặc đang trong giai đoạn sau sinh</li>\r\n</ul>\r\n<h3><span style=\"color: #000000;\"><strong>Hướng dẫn sử dụng</strong></span></h3>\r\n<ul>\r\n<li>Pha sữa bột Esbilac với nước ấm theo tỉ lệ 1:2 (1 phần sữa, 2 phần nước)</li>\r\n<li>Lưu ý không dùng nước quá nóng sẽ làm mất chất dinh dưỡng của sữa</li>\r\n<li>Lượng dùng không hết có thể bảo quản trong ngăn mát tủ lạnh và sử dụng hết trong vòng 24 giờ sau khi pha sữa</li>\r\n</ul>\r\n<h3><strong>Liều lượng</strong></h3>\r\n<ul>\r\n<li>Cún sơ sinh: 30ml sữa/115g thể trọng trong một ngày. Ngày 2 lần.</li>\r\n<li>Cún bầu hoặc đang cho con bú: 4g bột/2.2kg thể trọng trong một ngày.</li>\r\n<li>Với cún đang lớn hoặc cún ốm: 2g bột/2.2 kg thể trọng trong một ngày.</li>\r\n</ul>'),(105,85,0,36,'Sữa cho chó con, chó mẹ Esbilac'),(106,76,0,36,'<p>Sữa cho chó con, chó mẹ mang thai hoặc đang cho con bú. Esbilac là loại sữa có thương hiệu nổi tiếng của Mỹ, với công thức đặc biệt tương ứng như sữa chó mẹ.</p>'),(107,75,0,37,'<p><strong>Sữa cho chó mèo Bio Milk</strong></p>\r\n<p>Thông tin sản phẩm:</p>\r\n<ul>\r\n<li>Dạng bịch, khối lượng 100gr</li>\r\n<li><strong>Nguyên liệu:</strong> Các vitamin A, D3, E, B1, B12, Lysine HCI, Methionine, Cysteine, Threonine, Tryptophan, bột sữa.</li>\r\n<li><strong>Công dụng:</strong> Thức uống dinh dưỡng như sữa mẹ, bổ sung vitamin, đạm, béo và khoáng chất cần thiết cho chó mèo.</li>\r\n<li><strong>Đặc điểm:</strong> Bio Milk cho thú cưng với thành phần giàu dinh dưỡng, cân đối, dễ tiêu hóa như sữa mẹ, thay thế sữa mẹ trong trường hợp chó mèo mất sữa vì nhiều lý do. Đồng thời là nguồn bổ sung dinh dưỡng cho chó mèo, gầy yếu, chậm lớn.</li>\r\n</ul>\r\n<p><strong>Hướng dẫn sử dụng:</strong></p>\r\n<ul>\r\n<li>Thú cưng dưới 1 tháng tuổi: Hòa 1 muỗng cafe (khoảng 5gram) vào 20ml nước ấm, cho vào bình bú, ngày 4-5 lần.</li>\r\n<li>Thú cưng 1-2 tháng tuổi: Hòa 1 muỗng cafe (khoảng 5gram) vào 15ml nước ấm, cho uống trong máng hoặc chén, ngày 3-4 lần.</li>\r\n<li>Thú cưng trên 2 tháng tuổi, thú cưng gầy ốm: 1-2 muỗng mỗi ngày, hòa vào nước ấm cho uống hoặc trộn vào thức ăn thường ngày.</li>\r\n</ul>\r\n<p>Bảo quản nơi khô ráo thoáng mát, ánh ánh sáng trực tiếp.</p>'),(108,85,0,37,'Sữa cho chó mèo Bio Milk 100gr'),(109,76,0,37,'<p>Sữa cho chó mèo Bio Milk dạng bột với thành phần giàu chất dinh dưỡng, cân đối và dễ tiêu hóa tương tự sữa mẹ, có tác dụng thay thế sữa mẹ cho thú cưng.</p>'),(110,75,0,38,'<p><strong>Thức ăn cho mèo mẹ, mèo sơ sinh Royal Canin Mother &amp; Baby Cat</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ Pháp</li>\r\n<li>Dành cho mèo sơ sinh, mèo mẹ đang mang thai hoặc đang cho con bú</li>\r\n<li>Hỗ trợ đầy đủ dưỡng chất cho cả mèo mẹ và con</li>\r\n<li>Giúp mèo mẹ đỡ mệt mỏi, mèo con phát triển khỏe mạnh</li>\r\n<li>Bổ sung DHA giúp hỗ trợ phát triển nhận thức cho mèo con</li>\r\n</ul>'),(111,85,0,38,'Thức ăn cho mèo mẹ, mèo sơ sinh Royal Canin Mother & Baby Cat'),(112,76,0,38,'<p>Thức ăn cho mèo mẹ, mèo sơ sinh Royal Canin Mother &amp; Baby Cat giúp mèo đang mang thai cung cấp dưỡng chất cho mèo con trong bụng và mèo mẹ có nhiều sữa khi cho con bú.</p>'),(113,75,0,39,'<p><strong>Thức ăn cho mèo con Me-O Kitten</strong></p>\r\n<p> </p>\r\n<p>Xuất xứ Thái Lan</p>\r\n<p>Dành cho mọi loại mèo từ 2 - 12 tháng tuổi</p>\r\n<p>Được làm từ cá thật, đầy đủ dưỡng chất taurin, vitamin, canxi, phốt pho, Omega3-6, kẽm, natri thấp.</p>\r\n<p>Thức ăn Me-O Kitten dễ dàng tiêu hóa và mùi vị yêu thích của mọi chú mèo.</p>\r\n<p>Hướng dẫn sử dụng:</p>\r\n<p>- Khi thay đổi thức ăn cho mèo, chuyển dần dần từ lượng ít đến nhiều trong 5-7 ngày để mèo quen mùi vị và hệ tiêu hóa thích nghi, tránh rối loạn tiêu hóa, tiêu chảy.</p>\r\n<p>- Ngâm nước với tỉ lệ 3:1 (3 hạt : 1 nước) để hạt mềm giúp mèo dễ ăn hơn</p>\r\n<p>- Bảo quản trong hộp kín hoặc túi kín</p>\r\n<p>- Để nơi thoáng mát, tránh ánh nắng mặt trời</p>'),(114,85,0,39,'Thức ăn cho mèo con Me-O Kitten'),(115,76,0,39,'<p>Thức ăn cho mèo con Me-O Kitten chứa nhiều dinh dưỡng cần thiết cho sự phát triển của mèo con từ 2 - 12 tháng tuổi.</p>'),(116,75,0,40,'<p><strong>Thức ăn chống búi lông mèo Royal Canin Hairball Care</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ Pháp</li>\r\n<li>Dành cho mọi loại mèo trên 2 tháng tuổi</li>\r\n<li>Đặc tính của mèo hay liếm lông vì thế có rất nhiều lông trong hệ tiêu hóa của chúng, lâu ngày sẽ vón cục ngăn cản sự hấp thụ dinh dưỡng và làm chậm hệ tiêu hóa.</li>\r\n<li>Royal Canin Hairball Care hỗ trợ khắc phục vấn đề trên, giúp mèo tiêu hóa lông theo cách tự nhiên và phát triển khỏe mạnh</li>\r\n</ul>'),(117,85,0,40,'Thức ăn chống búi lông mèo Royal Canin Hairball Care'),(118,76,0,40,'<div class=\"desc wb-content\">\r\n<p>Thức ăn chống búi lông mèo Royal Canin Hairball Care hỗ trợ ngăn ngừa và điều trị bệnh búi lông ở mèo.</p>\r\n</div>'),(119,75,0,41,'<p><strong>Thức ăn hạt cho mèo con Nutrience Original (Cao cấp)</strong></p>\r\n<ul>\r\n<li>Thương hiệu: <strong>Nutrience</strong>, sản xuất và kiểm định tại Canada, được cấp phép xuất khẩu toàn cầu vào những thị trường khó tính nhất: Mỹ, Pháp, Châu Âu...</li>\r\n<li>Loại: <strong>Original</strong></li>\r\n<li><strong>Được nghiên cứu và sản xuất dành riêng cho mèo con</strong></li>\r\n<li>Thành phần: Bột thịt gà Canada, gạo lứt, bột yến mạch, đậu hà lan, mỡ gà (bảo quản với tocopherols hỗn hợp), bột củ cải khô, sản phẩm trứng, hương vị gà tự nhiên, hạt lanh, men bia, canxi cacbonat, dầu cá hồi (nguồn DHA), quả việt quất, quả nam việt quất , cà rốt.</li>\r\n<li><strong>Chất lượng đạt tiêu chuẩn 5 sao trên toàn thế giới</strong></li>\r\n<li>Cung cấp đầy đủ dưỡng chất thiết yếu hằng ngày cho bé mèo phát triển sức khỏe toàn diện</li>\r\n<li>Không gây tác dụng phụ, không bị sỏi thận</li>\r\n</ul>\r\n<p><strong>Vì sao bạn nên chọn thức ăn hạt Nutrience Original cho mèo con ?</strong></p>\r\n<p>Thịt gà chất lượng cao là thành phần chính trong công thức sản phẩm <strong>Nutrience Original </strong>cho mèo con giúp đảm bảo sự phát triển tối ưu của mèo con.</p>\r\n<ul>\r\n<li><strong>Phát triển cơ bắp khỏe mạnh: </strong>Mèo con đòi hỏi nhiều protein hơn trong chế độ ăn. Chúng tôi sử dụng bột thịt gà chất lượng cao làm thành phần chủ yếu và không sử dụng các phụ phẩm từ động vật (meat by-product) hoặc đạm thực vật, để đảm bảo cho mèo con của bạn phát triển cơ bắp chắc khỏe.</li>\r\n<li><strong>Hệ tiêu hóa khỏe mạnh: </strong>Sức khỏe tiêu hóa liên quan trực tiếp đến sức khỏe tổng thể của thú cưng. Công thức của chúng tôi bao gồm sự kết hợp của ngũ cốc nguyên hạt (gạo lứt), chất xơ tự nhiên và chất xơ hòa tan (prebiotic) để giúp mèo con của bạn duy trì đường ruột khỏe mạnh.</li>\r\n<li><strong>Phát triển nhận thức:</strong> Dầu hạt lanh và dầu cá hồi là nguồn DHA tự nhiên đóng một vai trò quan trọng trong sự phát triển của não và hệ thần kinh của mèo con. Chúng tôi đảm bảo mức độ thích hợp trong mỗi túi thức ăn nhằm hỗ trợ phát triển trí não giúp mèo con của bạn thông minh hơn.</li>\r\n<li><strong>Da và lông khỏe mạnh:</strong> Các axit béo omega-3 cũng như axit béo omega-6 có nguồn gốc từ đất (hạt lanh) và biển (dầu cá hồi) cung cấp cho mèo con của bạn một tỷ lệ chất béo lành mạnh cân bằng và đa dạng hơn để giúp da phát triển khỏe mạnh và lớp lông bóng mượt.</li>\r\n<li><strong>Hệ miễn dịch khỏe mạnh:</strong> Chúng tôi sử dụng nhiều nguồn nguyên liệu tự nhiên có chứa chất chống oxy hóa cho các công thức dinh dưỡng Nutrience (quả việt quất, nam việt quất và cà rốt cùng với vitamin C, vitamin E và taurine) để chúng hoạt động cùng nhau hỗ trợ hệ thống miễn dịch đang phát triển của mèo con.</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>Cách cho ăn:</strong></p>\r\n<p>Nếu thú cưng có hệ tiêu hoá nhạy cảm hoặc kén ăn thì chúng ta phải chuyển dần dần từ thức ăn này sang thức ăn khác để tránh gây kích ứng cho hệ tiêu hóa. Để thú cưng thích ứng với Nutrience bạn có thể làm theo cách này:</p>\r\n<ul>\r\n<li>Bắt đầu với tỷ lệ 25% thức ăn Nutrience trộn với 75% thực phẩm cũ đang sử dụng.</li>\r\n<li>Từ từ thay đổi tỷ lệ trong 5 đến 7 ngày tiếp theo bằng cách tăng dần lượng thức ăn Nutrience và giảm dần lượng thức ăn cũ đang sử dụng đến khi thú cưng đổi hẳn sang thức ăn mới 100%</li>\r\n</ul>'),(120,85,0,41,'Thức ăn hạt cho mèo con Nutrience Original (1.13 Kg)'),(121,76,0,41,'<p>Thức ăn hạt cho mèo con Nutrience Original nhập khẩu Canada. Thành phần sản xuất dành riêng cho mèo con dưới 12 tháng tuôi.</p>'),(122,75,0,42,'<p><strong>Thức ăn cho mèo trưởng thành Catsrang Adult 1.5 Kg</strong></p>\r\n<ul>\r\n<li>Thức ăn hạt cho mèo trưởng thành CATSRANG Adult là sản phẩm thức ăn chuyên dành cho mèo trưởng thành.</li>\r\n<li>Sản phẩm này có nguồn gốc từ Hàn Quốc, mang thương hiệu CATSRANG.</li>\r\n<li>Với dây chuyền sản xuất hiện đại, sản phẩm luôn đảm bảo an toàn cho mèo cưng bạn nhé.</li>\r\n<li>Với đặc tính dễ tiêu, hạt Catsrang giúp mèo đi phân rắn và giảm thiểu mùi hôi khó chịu.</li>\r\n<li>Ngăn ngừa lông vón cục trong ruột mèo. Hàm lượng dinh dưỡng cân bằng, catsrang phù hợp trong việc cải thiện da lông, phòng tránh bệnh quáng gà ở mèo.</li>\r\n<li>Sử dụng protein cao cấp tốt cho hệ tiêu hóa.</li>\r\n<li>Đặc biệt, sản phẩm không sử dụng chất bảo quản, chất kháng sinh, phẩm màu hay hương liệu nhân tạo khác.</li>\r\n</ul>'),(123,85,0,42,'Thức ăn cho mèo trưởng thành Catsrang Adult 1.5 Kg'),(124,76,0,42,'<p>Thức ăn cho mèo trưởng thành Catsrang Adult là sản phẩm xuất xứ Hàn Quốc, thức ăn chuyên dành cho mèo lớn hơn 12 thàng tuổi.</p>'),(125,75,0,43,'<p><strong>Thức ăn hạt cho mèo Earthborn Wild Sea Catch</strong></p>\r\n<p>Là thương hiệu thức ăn thú cưng <strong>hàng đầu của Mỹ</strong>, với công thức Grain Free không chứa ngũ cốc. Công thức với các thành phần vô cùng lành mạnh như: cá hồi, cá trích giúp dễ tiêu hóa cộng với rau, trái cây (việt quất, rau bina, táo và nam việt quất), vitamin, omega, taurine và men vi sinh.</p>\r\n<ul>\r\n<li>Xuất xứ: Mỹ</li>\r\n<li>Khối lượng: 2.27 Kg</li>\r\n<li>Dành cho mèo mọi lứa tuổi</li>\r\n<li>Dòng sản phẩm Grain Free không ngũ cốc</li>\r\n</ul>\r\n<p><strong>Đặc điểm nổi bật:</strong></p>\r\n<ul>\r\n<li>Protein chính từ cá hồi và cá trích dễ tiêu hóa giúp hỗ trợ cơ bắp phát triển, phù hợp với cả mèo con và mèo trưởng thành.</li>\r\n<li>Chất chống oxy hóa từ các loại trái cây và rau giàu dinh dưỡng hỗ trợ hệ thống miễn dịch khỏe mạnh, và taurine hỗ trợ sức khỏe của tim và thị lực.</li>\r\n<li>Axit béo omega-3 và 6 để nuôi dưỡng da và lông, và các chất xơ tự nhiên để hỗ trợ sức khỏe đường tiêu hóa.</li>\r\n<li>Vì không có ngũ cốc hoặc gluten, sản phẩm này cực tốt cho những chú mèo bị nhạy cảm hoặc dị ứng thực phẩm và chứa các khoáng chất để hỗ trợ xương chắc khỏe.</li>\r\n<li>Được sản xuất tại Mỹ trong bao bì không chứa BPA từ khí tự nhiên sạch nên thân thiện với môi trường.</li>\r\n</ul>'),(126,85,0,43,'Thức ăn hạt cho mèo Earthborn Wild Sea Catch 2.27 KG'),(127,76,0,43,'<p>Thức ăn hạt cho mèo Earthborn Wild Sea Catch là thương hiệu thức ăn thú cưng hàng đầu của Mỹ, với công thức Grain Free không chứa ngũ cốc.</p>'),(128,75,0,44,'<p><strong>Thức ăn cho mèo Pro Pac Savanna Pride Indoor Formula</strong></p>\r\n<p>Sản phẩm được làm từ chất lượng cao nhất của bột gà, là bữa ăn rất giàu hàm lượng chất xơ, giúp kiểm soát và loại bỏ búi lông.</p>\r\n<ul>\r\n<li>Xuất xứ: Mỹ</li>\r\n<li>Khối lượng: 2 Kg</li>\r\n<li>Dành cho mèo mọi lứa tuổi</li>\r\n<li>Dòng sản phẩm Grain Free không ngũ cốc</li>\r\n</ul>\r\n<p><strong>Đặc điểm nổi bật:</strong></p>\r\n<ul>\r\n<li>Công thức không ngũ cốc rất tốt  ho những chú mèo nhạy cảm. Bột thịt gà chất lượng cao là nguồn protein chính giúp xây dựng và duy trì cơ bắp chắc khỏe.</li>\r\n<li>Tăng cường axit béo Omega-6, Omega-3 (hỗ trợ sức khỏe của da và lông), Vitamin E, vitamin C cùng với các loại trái cây và rau giàu chất chống oxy hóa giúp hỗ trợ tiêu hóa tốt và sức khỏe đường ruột.</li>\r\n<li>Sự cân bằng của canxi và phốt pho giúp xây dựng xương chắc khỏe. Hạt thức ăn giòn giúp làm sạch răng và làm hơi thở tươi mới.</li>\r\n<li>Chất xơ được bổ sung giúp kiểm soát búi lông, và Taurine - một loại axit amin, giúp hỗ trợ chức năng cơ tim và thị lực.</li>\r\n</ul>'),(129,85,0,44,'Thức ăn cho mèo Pro Pac Savanna Pride Indoor Formula 2 KG'),(130,76,0,44,'<p>Thức ăn cho mèo Pro Pac Savanna Pride Indoor Formula được làm từ chất lượng cao nhất của bột gà, là bữa ăn rất giàu hàm lượng chất xơ, giúp kiểm soát và loại bỏ búi lông.</p>'),(131,75,0,45,'<p><strong>Thức ăn giàu đạm cho mèo Natural Core</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Khối lượng: 1 Kg</li>\r\n<li>Dành cho mèo mọi lứa tuổi</li>\r\n</ul>\r\n<p> </p>'),(132,85,0,45,'Thức ăn giàu đạm cho mèo Natural Core 1Kg'),(133,76,0,45,'<p>Thức ăn giàu đạm cho mèo Natural Core được chế biến từ thịt gà, thịt cá hồi, thịt vịt rút xương, hồng sâm… với 95% thành phần hữu cơ và 5% khoáng chất vô cơ tốt cho sức khỏe mèo, phù hợp với mọi lứa tuổi, mọi giống mèo.</p>'),(134,75,0,46,'<p><strong>Thức ăn hạt khô cho mèo mọi lứa tuổi Catsrang</strong></p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Với đặc tính dễ tiêu, hạt Catsrang giúp mèo đi phân rắn và giảm thiểu mùi hôi khó chịu.</li>\r\n<li>Ngăn ngừa lông vón cục trong ruột mèo.</li>\r\n<li>Hàm lượng dinh dưỡng cân bằng, catsrang phù hợp trong việc cải thiện da lông, phòng tránh bệnh quáng gà ở mèo.</li>\r\n<li>Sử dụng protein cao cấp tốt cho hệ tiêu hóa.</li>\r\n<li>Đặc biệt, sản phẩm không sử dụng chất bảo quản, chất kháng sinh, phẩm màu hay hương liệu nhân tạo khác.</li>\r\n</ul>'),(135,85,0,46,'Thức ăn hạt khô cho mèo mọi lứa tuổi Catsrang'),(136,76,0,46,'<p>Thức ăn hạt khô cho mèo mọi lứa tuổi Catsrang sử dụng protein cao cấp tốt cho hệ tiêu hóa. Đặc biệt, sản phẩm không sử dụng chất bảo quản, chất kháng sinh, phẩm màu hay hương liệu nhân tạo khác.</p>'),(137,75,0,47,'<p><strong>Bánh thưởng snack hỗn hợp cho mèo Bowwow</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Khối lượng: 35gram</li>\r\n<li>Dành cho mèo mọi lứa tuổi</li>\r\n</ul>'),(138,85,0,47,'Bánh thưởng snack hỗn hợp cho mèo Bowwow'),(139,76,0,47,'<p>Bánh thưởng snack hỗn hợp cho mèo Bowwow bổ sung protein, DHA, taurin, vitamin, khoáng chất thiết yếu cho mèo, phù hợp với mọi giai đoạn phát triển.</p>'),(140,75,0,48,'<p><strong>Ức gà sấy cho mèo Bowwow</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Khối lượng: 30gram</li>\r\n<li>Dành cho mèo trên 3 tháng tuổi</li>\r\n</ul>\r\n<p><strong><span style=\"color: #000000;\">Đặc điểm nổi bật</span></strong></p>\r\n<ul>\r\n<li>Ức gà được sấy khô ở nhiệt độ thấp, có hương vị thơm ngon độc đáo. </li>\r\n<li>Giàu protein, ít béo, hỗ trợ tăng cường cơ bắp mà không gây béo phì.  </li>\r\n<li>Giảm mùi phân và mùi nước tiểu. </li>\r\n<li>Hỗ trợ tiêu hóa, tăng khả năng hấp thu. </li>\r\n<li>Gói nhỏ dễ bảo quản, giữ được độ tươi ngon.  </li>\r\n<li>Snack dạng mềm, phù hợp với mọi lứa tuổi. </li>\r\n</ul>\r\n<h4> </h4>\r\n<p> </p>\r\n<p>Ức gà sấy cho mèo Chicken Breast Slice giàu protein, hỗ trợ tăng cường cơ bắp, chứa các axit amin thiết yếu, thúc đẩy hoạt động dẫn truyền xung thần kinh và giảm stress. Đây là món ăn nhẹ tốt cho sức khỏe của mèo, có thể ăn nhiều mà không bị béo phì.</p>'),(141,85,0,48,'Ức gà sấy cho mèo Bowwow'),(142,76,0,48,'<p>Ức gà sấy cho mèo Bowwow giàu protein, hỗ trợ tăng cường cơ bắp, chứa các axit amin thiết yếu, thúc đẩy hoạt động dẫn truyền xung thần kinh và giảm stress.</p>'),(143,75,0,49,'<p><strong>Xúc xích cá hồi hun khói cho mèo Bowwow</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ : Hàn Quốc</li>\r\n<li>Khối lượng: 70gram (7 cây)</li>\r\n<li>Dùng cho mèo mọi lứa tuổi</li>\r\n</ul>\r\n<h4><strong>Đặc điểm nổi bật</strong><br />Món ăn nhẹ thơm ngon, có lợi cho sức khỏe của mèo: </h4>\r\n<ul>\r\n<li>Làm từ cá hồi tươi, tiêu chuẩn như thức ăn của người. </li>\r\n<li>DHA, Omega-3 hỗ trợ phát triển trí não và thị lực. </li>\r\n<li>Chứa taurin tốt cho tim mạch.</li>\r\n<li>Không chứa bột ngọt, màu nhân tạo. </li>\r\n<li>Snack dạng mềm, phù hợp với mọi lứa tuổi.</li>\r\n<li>Gói nhỏ dễ bảo quản, giữ được độ tươi ngon. </li>\r\n</ul>\r\n<h4> </h4>\r\n<p>Thịt cá hồi hun khói Smoked Salmon Meat Stick là món ăn nhẹ cho mèo dạng mềm, thơm ngon, bổ sung những dưỡng chất cần thiết. Đặc biệt, sản phẩm không chứa bột ngọt, màu nhân tạo, hàm lượng muối thấp, không có hại cho tim mạch, gan, thận của mèo.</p>'),(144,85,0,49,'Xúc xích cá hồi hun khói cho mèo Bowwow'),(145,76,0,49,'<p>Xúc xích cá hồi hun khói cho mèo Bowwow là món ăn nhẹ thơm ngon, rất có lợi cho sức khỏe của mèo.</p>'),(146,75,0,50,'<p><strong>Cỏ mèo khô bạc hà Catnip</strong></p>\r\n<ul>\r\n<li>Giúp mèo thư giãn, ngoan ngoãn</li>\r\n<li>Mèo hay liếm lông, nên trong ruột có rất nhiều lông, catnip giúp mèo đẩy hết lông trong ruột ra ngoài, không còn bị tắt ruột, hệ tiêu hóa khỏe mạnh hơn</li>\r\n<li>Chỉ sử dụng cho mèo từ 6 tháng tuổi trở lên</li>\r\n<li>Mỗi ngày chỉ 1-3 gram, đặt vào món đồ chơi hoặc rải dưới sàn để mèo ngửi và ăn</li>\r\n<li>Không sử dụng quá nhiều vì sẽ làm mất tác dụng, mèo không còn thích thú</li>\r\n<li>Sau khi sử dụng 10-15 phút, mèo có biểu hiện: hắt hơi, lăn dưới sàn, kêu gru..gru... đó là lúc mèo được thư giãn, phục hồi sức khỏe và giảm stress</li>\r\n<li>Sản phẩm được chuyên gia khuyên dùng, không gây nghiện, không tác dụng phụ, rất tốt cho sức khỏe mèo</li>\r\n</ul>'),(147,85,0,50,'Cỏ mèo khô bạc hà Catnip'),(148,76,0,50,'<p>Cỏ mèo khô bạc hà Catnip là món ăn ưa thích của tất cả loại mèo, giúp mèo thích thú, thư giãn... Bên cạnh đó, cỏ mèo còn giúp hệ tiêu hóa các \"hoàng thượng\" khỏe mạnh hơn...</p>'),(149,75,0,51,'<p><strong>Bánh thưởng cho mèo Snack tươi</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Vị gà và cá ngừ</li>\r\n<li>Thơm ngon bổ dưỡng, món ăn vặt yêu thích của mọi chú mèo</li>\r\n<li>Khối lượng: 30 gram</li>\r\n</ul>'),(150,85,0,51,'Bánh thưởng cho mèo Snack tươi 30 gram'),(151,76,0,51,'<p>Bánh thưởng cho mèo Snack tươi vị gà và cá ngừ thơm ngon bổ dưỡng, món ăn vặt yêu thích của mọi chú mèo.</p>'),(152,75,0,52,'<p><strong>Cây cỏ mèo khô viên tròn</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Là món ăn thỉnh thoảng yêu thích của tất cả loại mèo</li>\r\n<li>Giúp mèo thư giãn, tạo cảm giác thích thú khi ăn cỏ</li>\r\n<li>Tác dụng hạn chế búi lông ở mèo</li>\r\n</ul>'),(153,85,0,52,'Cây cỏ mèo khô viên tròn'),(154,76,0,52,'<div class=\"desc wb-content\">\r\n<p>Cây cỏ mèo khô viên tròn là món ăn thỉnh thoảng yêu thích của tất cả loại mèo.</p>\r\n</div>'),(155,75,0,53,'<p><strong>Pate cho mèo con Snappy Tom 150 gram</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: nhập khẩu Thái Lan chính hãng</li>\r\n<li>Dành cho mèo dưới 6 tháng tuổi</li>\r\n<li>Giúp mèo ăn ngon miệng, thay đổi khẩu vị, điều trị biếng ăn, cung cấp dinh dưỡng hoàn chỉnh giúp mèo phát triển khỏe mạnh.</li>\r\n<li>Thành phần: Phụ phẩm gia cầm, bột gia cầm, cá ngừ, dầu đậu tương, tinh bột kết dính, guar gum, Choline chloride, Calcium, taurin, Premix vitamin và khoáng chất.</li>\r\n<li>Số tiêu chuẩn công bố: TCCS 02:2019/GOTG.HCM</li>\r\n<li>Bảo quản nhiệt độ phòng, để ngăn mát và dùng hết trong 48 tiếng sau khi mở nắp</li>\r\n</ul>'),(156,85,0,53,'Pate cho mèo con Snappy Tom 150 gram'),(157,76,0,53,'<p>Pate cho mèo con Snappy Tom 150 gram dạng gói là thức ăn hỗn hợp hoàn chỉnh công thức đặc biệt dành cho mèo dưới 6 tháng tuổi, nhiều dinh dưỡng, đặc biệt thành phần Grain Free không ngũ cốc rất tốt cho sự phát triển của mèo con.</p>'),(158,75,0,54,'<p><strong>Cá hộp cho mèo Tuna White Meat &amp; Salmon</strong></p>\r\n<p> </p>\r\n<p>Xuất xứ: Hàn Quốc</p>\r\n<p>Khối lượng: 80 gram</p>\r\n<ul>\r\n<li>Sử dụng thịt cá ngừ trắng và cá hồi tươi, miếng cá mềm, kích thước nhỏ vừa ăn. </li>\r\n<li>Dành cho mọi lứa tuổi, kể cả mèo con, mèo lớn tuổi và mèo có hệ tiêu hóa nhạy cảm. </li>\r\n<li>Giàu DHA, omega-3, giúp mèo sáng mắt, mượt lông. </li>\r\n<li>Bổ sung taurin, tốt cho tim mạch và trí não.</li>\r\n<li>Cấp nước cho chế độ ăn hằng ngày, đặc biệt phù hợp với những chú mèo ít uống nước.</li>\r\n<li>Hộp nhôm hút chân không hiện đại, giữ sản phẩm tươi ngon. </li>\r\n</ul>\r\n<p>Trong cá ngừ, thịt trắng là phần tinh túy, giàu dinh dưỡng và có nhiều lợi ích đặc biệt đối với sức khỏe và làm đẹp. Thịt trắng có nhiều lợi ích: giàu chất béo bão hòa không no - chất béo có lợi cho sức khỏe, dễ tiêu hóa và hấp thu, giúp cơ thể đào thải lượng cholesterol xấu, tốt cho tim mạch.</p>\r\n<p>Cá ngừ trắng &amp; Cá hồi đóng hộp Tuna White Meat bổ sung những vitamin và khoáng chất thiết yếu mà bữa ăn hằng ngày có thể bị thiếu hụt. Sản phẩm hỗ trợ chăm sóc lông bóng mượt, giúp sáng mắt, giảm đổ ghèn, tăng cường trí não.</p>'),(159,85,0,54,'Cá hộp cho mèo Tuna White Meat & Salmon'),(160,76,0,54,'<p>Cá hộp cho mèo Tuna White Meat &amp; Salmon là món ăn nhẹ bổ sung hằng ngày, giàu dinh dưỡng, hỗ trợ cho sự phát triển toàn diện của mèo.</p>'),(161,75,0,55,'<p><strong>Sốt cá ngừ cho mèo Ciao Churu</strong></p>\r\n<ul>\r\n<li>Xuất xứ: Thái Lan, chất lượng cao cấp hơn các loại Ciao giá rẻ nhập từ Trung Quốc</li>\r\n<li>Khối lượng: 20 gói x 14 gram</li>\r\n<li>Dành cho mèo mọi lứa tuổi</li>\r\n<li>Thành phần: Cá ngừ, tinh bột chế biến, chất tạo mùi, Guar Gum, chiết xuất tảo biển, Vitamin E, Carrageenan, bột trà xanh, Fructooligosaccharides.</li>\r\n<li>Hướng dẫn sử dụng: Cho ăn trực tiếp (dùng không hết bỏ vào ngăn mát tủ lạnh sử dụng trong 48 tiếng)</li>\r\n</ul>'),(162,85,0,55,'Sốt cá ngừ cho mèo Ciao Churu (20 gói)'),(163,76,0,55,'<p>Sốt cá ngừ cho mèo Ciao Churu là thức ăn bổ sung dinh dưỡng cao cấp cho mèo hàng ngày, giúp mèo phát triển khỏe mạnh.</p>'),(164,75,0,56,'<p><strong>Sốt cho mèo cá ngừ mix sò điệp Ciao Churu</strong></p>\r\n<ul>\r\n<li>Xuất xứ: Thái Lan, chất lượng cao cấp hơn các loại Ciao giá rẻ nhập từ Trung Quốc</li>\r\n<li>Khối lượng: 20 gói x 14 gram</li>\r\n<li>Dành cho mèo mọi lứa tuổi</li>\r\n<li>Thành phần: Cá ngừ, chiết xuất sò điệp, tinh bột biến tính, chất tạo mùi, Guar Gum, Vitamin E, Carrageenan, bột trà xanh, Fructooligosaccharides.</li>\r\n<li>Hướng dẫn sử dụng: Cho ăn trực tiếp (dùng không hết bỏ vào ngăn mát tủ lạnh sử dụng trong 48 tiếng)</li>\r\n</ul>'),(165,85,0,56,'Sốt cho mèo cá ngừ mix sò điệp Ciao Churu (20 gói)'),(166,76,0,56,'<p>Sốt cho mèo cá ngừ mix sò điệp Ciao Churu là món ăn phụ ngon miệng cung cấp dinh dưỡng thiết yếu hằng ngày cho mèo luôn khỏe mạnh.</p>'),(167,75,0,57,'<p><strong>Sốt Ciao Churu gà sò cho mèo</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Thái Lan, chất lượng cao cấp hơn các loại Ciao giá rẻ nhập từ Trung Quốc</li>\r\n<li>Khối lượng: 4 gói x 14 gram</li>\r\n<li>Dành cho mèo mọi lứa tuổi</li>\r\n<li>Thành phần: thịt gà, sò, cá ngừ xông khói, vitamin E, bột trà xanh</li>\r\n<li>Hướng dẫn sử dụng: Cho ăn trực tiếp (dùng không hết bỏ vào ngăn mát tủ lạnh sử dụng trong 48 tiếng)</li>\r\n</ul>'),(168,85,0,57,'Sốt cho mèo Ciao gà sò (4 gói)'),(169,76,0,57,'<p>Sốt cho mèo Ciao gà sò cung cấp dinh dưỡng thiết yếu hằng ngày cho mèo luôn khỏe mạnh, năng động và ăn ngon miệng.</p>'),(170,75,0,58,'<p><strong>Sốt dinh dưỡng cá ngừ cho mèo Chupa Creamy</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Quy cách: 1 bịch 4 gói (14gram/gói)</li>\r\n<li>Thức ăn dinh dưỡng dành cho mèo tất cả lứa tuổi</li>\r\n</ul>\r\n<h4><strong>Đặc điểm nổi bật</strong></h4>\r\n<p>Sốt dinh dưỡng cho mèo Chupa Creamy là món ăn nhẹ tuyệt vời dành cho mèo: </p>\r\n<ul>\r\n<li>100% thịt thật, bổ sung nhiều dưỡng chất, hương vị thơm ngon, hấp dẫn. </li>\r\n<li>6 FREE - KHÔNG chứa 6 chất sau: Muối, đường, màu nhân tạo, chất bảo quản, phụ phẩm, ngũ cốc.  </li>\r\n<li>Không ngũ cốc, có lợi cho tiêu hóa, ngăn ngừa dị ứng. </li>\r\n<li>Chứa taurin, tốt cho tim mạch và trí não của mèo.</li>\r\n<li>Chất kem mềm mịn nhờ công nghệ xay siêu tốc và hút chân không hiện đại.</li>\r\n<li>Dạng tuýp nhỏ, bao bì tiệt trùng, dễ dàng bảo quản. </li>\r\n</ul>\r\n<h4> </h4>\r\n<p>Bổ sung các vitamin, khoáng chất thiết yếu cho mèo, phù hợp với mọi giai đoạn phát triển. Đặc biệt, sốt dinh dưỡng Chupa Creamy không sử dụng ngũ cốc giá rẻ (lúa mì, ngô) nên không gây dị ứng, an toàn cho sức khỏe của mèo cưng.</p>\r\n<p>Thành phần cá ngừ, chiết xuất trà xanh, rong biển, giúp ngăn ngừa búi lông ở mèo.</p>'),(171,85,0,58,'Sốt dinh dưỡng cá ngừ cho mèo Chupa Creamy'),(172,76,0,58,'<div class=\"desc wb-content\">\r\n<p>Sốt dinh dưỡng cá ngừ cho mèo Chupa Creamy bổ sung các vitamin, khoáng chất thiết yếu cho mèo, phù hợp với mọi giai đoạn phát triển.</p>\r\n</div>'),(173,75,0,59,'<p><strong>Sốt dinh dưỡng cho mèo cá hồi &amp; cá tráp Chupa Creamy</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Quy cách: 1 bịch 4 gói (14gram/gói)</li>\r\n<li>Thức ăn dinh dưỡng dành cho mèo tất cả lứa tuổi</li>\r\n</ul>\r\n<h4><strong>Đặc điểm nổi bật</strong></h4>\r\n<p>Sốt dinh dưỡng cho mèo Chupa Creamy là món ăn nhẹ tuyệt vời dành cho mèo: </p>\r\n<ul>\r\n<li>100% thịt thật, bổ sung nhiều dưỡng chất, hương vị thơm ngon, hấp dẫn. </li>\r\n<li>6 FREE - KHÔNG chứa 6 chất sau: Muối, đường, màu nhân tạo, chất bảo quản, phụ phẩm, ngũ cốc.  </li>\r\n<li>Không ngũ cốc, có lợi cho tiêu hóa, ngăn ngừa dị ứng. </li>\r\n<li>Chứa taurin, tốt cho tim mạch và trí não của mèo.</li>\r\n<li>Chất kem mềm mịn nhờ công nghệ xay siêu tốc và hút chân không hiện đại.</li>\r\n<li>Dạng tuýp nhỏ, bao bì tiệt trùng, dễ dàng bảo quản. </li>\r\n</ul>\r\n<h4> </h4>\r\n<p> </p>\r\n<p>Bổ sung các vitamin, khoáng chất thiết yếu cho mèo, phù hợp với mọi giai đoạn phát triển. Đặc biệt, sốt dinh dưỡng Chupa Creamy không sử dụng ngũ cốc giá rẻ (lúa mì, ngô) nên không gây dị ứng, an toàn cho sức khỏe của mèo cưng.</p>'),(174,85,0,59,'Sốt dinh dưỡng cho mèo cá hồi & cá tráp Chupa Creamy'),(175,76,0,59,'<p>Sốt dinh dưỡng cho mèo cá hồi &amp; cá tráp Chupa Creamy chứa taurin, tốt cho tim mạch và trí não của mèo.</p>'),(176,75,0,60,'<p><strong>Sốt dinh dưỡng cho mèo ức gà &amp; tôm Chupa Creamy</strong></p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Quy cách: 1 bịch 4 gói (14gram/gói)</li>\r\n<li>Thức ăn dinh dưỡng dành cho mèo tất cả lứa tuổi</li>\r\n</ul>\r\n<h4><strong>Đặc điểm nổi bật</strong></h4>\r\n<p>Sốt dinh dưỡng cho mèo Chupa Creamy là món ăn nhẹ tuyệt vời dành cho mèo: </p>\r\n<ul>\r\n<li>100% thịt thật, bổ sung nhiều dưỡng chất, hương vị thơm ngon, hấp dẫn. </li>\r\n<li>6 FREE - KHÔNG chứa 6 chất sau: Muối, đường, màu nhân tạo, chất bảo quản, phụ phẩm, ngũ cốc.  </li>\r\n<li>Không ngũ cốc, có lợi cho tiêu hóa, ngăn ngừa dị ứng. </li>\r\n<li>Chứa taurin, tốt cho tim mạch và trí não của mèo.</li>\r\n<li>Chất kem mềm mịn nhờ công nghệ xay siêu tốc và hút chân không hiện đại.</li>\r\n<li>Dạng tuýp nhỏ, bao bì tiệt trùng, dễ dàng bảo quản. </li>\r\n</ul>\r\n<h4> </h4>\r\n<p>Bổ sung các vitamin, khoáng chất thiết yếu cho mèo, phù hợp với mọi giai đoạn phát triển. Đặc biệt, sốt dinh dưỡng Chupa Creamy không sử dụng ngũ cốc giá rẻ (lúa mì, ngô) nên không gây dị ứng, an toàn cho sức khỏe của mèo cưng.</p>'),(177,85,0,60,'Sốt dinh dưỡng cho mèo ức gà & tôm Chupa Creamy'),(178,76,0,60,'<p>Sốt dinh dưỡng cho mèo ức gà &amp; tôm Chupa Creamy chứa 100% thịt thật, bổ sung nhiều dưỡng chất, hương vị thơm ngon, hấp dẫn. </p>'),(179,75,0,61,'<p><strong>Sữa cho mèo con Lactol Beaphar</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hà Lan</li>\r\n<li>Khối lượng 250 gram</li>\r\n<li>Sữa dinh dưỡng dành cho mèo con, mèo mẹ mang thai, mèo mẹ đang cho con bú hoặc mèo đang cần hồi phục sau bệnh...</li>\r\n<li>Công thức đặc biệt cung cấp vitamin và khoáng chất cần thiết cho mèo</li>\r\n<li>Bổ sung DHA giúp mèo phát triển nhận thức, thông minh hơn</li>\r\n</ul>'),(180,85,0,61,'Sữa cho mèo con Lactol Beaphar'),(181,76,0,61,'<p>Sữa cho mèo con Lactol Beaphar là thực phẩm bổ sung dinh dưỡng cho mèo con, mèo mẹ mang thai, mèo mẹ đang cho con bú hoặc mèo đang trong giai đoạn cần hồi phục.</p>'),(182,75,0,62,'<p><strong>Đồ chơi thú cưng quả bóng có lục lạc</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Kích thước: 4.4 x 4.4 cm</li>\r\n<li>Chất liệu nhựa, bên trong có lục lạc leng keng</li>\r\n<li>Món đồ chơi thích hợp cho chó mèo loại nhỏ</li>\r\n</ul>'),(183,85,0,62,'Đồ chơi thú cưng quả bóng có lục lạc'),(184,76,0,62,'<p>Đồ chơi thú cưng quả bóng có lục lạc là món đồ chơi bé xinh thích hợp cho các bé chó mèo size nhỏ.</p>'),(185,75,0,63,'<p><strong>Quả bóng chứa thức ăn chó mèo</strong></p>\r\n<ul>\r\n<li>Đây là món đồ chơi không thể thiếu của các boss</li>\r\n<li>Giúp chó mèo vừa vận động, chơi đùa... vừa ăn các loại hạt thức ăn bên trong quả bóng rơi ra</li>\r\n<li>Chất liệu nhựa ABS cao cấp, an toàn tuyệt đối</li>\r\n<li>Có thể điều chỉnh lổ rơi hạt theo mọi kích thước hạt mà bạn có sẵn</li>\r\n<li>Dễ dàng vệ sinh và bảo quản</li>\r\n</ul>'),(186,85,0,63,'Quả bóng chứa thức ăn chó mèo'),(187,76,0,63,'<p><strong>Quả bóng chứa thức ăn chó mèo</strong> là món đồ chơi rất hữu ít cho các bé pet, giúp bé vừa vận động vừa ăn vặt, phát triển sức khỏe toàn diện.</p>'),(188,75,0,64,'<p><strong>Đồ chơi cho chó mèo chống ngứa răng</strong></p>\r\n<ul>\r\n<li>Chất liệu cao su hoàn toàn tự nhiên, an toàn cho thú cưng</li>\r\n<li>Mùi sữa giúp chó mèo thích thú hơn</li>\r\n<li>Có độ nảy phù hợp</li>\r\n<li>Làm sạch răng, chống ngứa răng, tránh trường hợp thú cưng cắn phá đồ trong nhà</li>\r\n</ul>'),(189,85,0,64,'Đồ chơi cho chó mèo chống ngứa răng'),(190,76,0,64,'<p>Đồ chơi cho chó mèo chống ngứa răng, chất liệu cao su tự nhiên an toàn, mùi sữa, màu sắc tươi mới, dễ thương... Sản phẩm giúp thú cưng thư giãn rất tốt.</p>'),(191,75,0,65,'<p><strong>Đồ chơi thú cưng quả bóng cao su có kèn</strong></p>\r\n<ul>\r\n<li>Chất liệu cao su tự nhiên TPR an toàn, độ bền cao</li>\r\n<li>Có trang bị kèn phát âm thanh khi chó mèo cắn vào quả bóng</li>\r\n<li>Có khả năng đàn hồi và độ nảy tự nhiên khi chạm đất</li>\r\n<li>Dùng đế huấn luyện hoặc cho thú cưng chơi đùa thư giãn</li>\r\n<li>Kích thước 9x6 cm</li>\r\n<li>Nặng 78 gram</li>\r\n</ul>'),(192,85,0,65,'Đồ chơi thú cưng quả bóng cao su có kèn'),(193,76,0,65,'<p>Quả bóng cao su có kèn là món đồ chơi yêu thích của thú cưng. Chất liệu cao su tự nhiên TPR an toàn tuyệt đối, giúp thú cưng thoải mái cắn thư giãn và làm sạch răng.</p>'),(194,75,0,66,'<p><strong>Vòng cổ dây xích inox cho chó</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Chât liệu inox 304 cao cấp, bền chắc</li>\r\n<li>Thích hợp cho những chú cún tinh nghịch hay cắn phá làm hư các loại dây vải, da, cao su...</li>\r\n<li>Nhiều kích thước phù hợp mọi loại cún</li>\r\n</ul>\r\n<table style=\"height: 132px;\" border=\"1\" width=\"644\" cellspacing=\"1\" cellpadding=\"1\" align=\"center\">\r\n<tbody>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 252.391px; height: 18px;\">Size</td>\r\n<td style=\"width: 378.609px; height: 18px;\"> Kích thước</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 252.391px; height: 18px;\">S</td>\r\n<td style=\"width: 378.609px; height: 18px;\">2.0mm*40cm</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 252.391px; height: 18px;\">M</td>\r\n<td style=\"width: 378.609px; height: 18px; text-align: left;\">2.5mm*45cm</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 252.391px; height: 18px;\">L</td>\r\n<td style=\"width: 378.609px; height: 18px;\">3.0mm*50cm</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 252.391px; height: 18px;\">XL</td>\r\n<td style=\"width: 378.609px; height: 18px;\">3.5mm*55cm</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 252.391px; height: 18px;\">XXL</td>\r\n<td style=\"width: 378.609px; height: 18px;\">4.0mm*60cm</td>\r\n</tr>\r\n</tbody>\r\n</table>'),(195,85,0,66,'Vòng cổ dây xích inox cho chó'),(196,76,0,66,'<p>Vòng cổ dây xích inox cho chó với độ bền tuyệt đối, thích hợp cho những chú cún tinh nghịch hay cắn phá làm hư các loại dây vải, da, cao su...</p>'),(197,75,0,67,'<p><strong>Đồ chơi đánh răng cho chó</strong></p>\r\n<ul>\r\n<li>Nếu bạn đang gặp rắc rối về việc đánh răng cho cún nhà mình thì đây là một giải pháp hiệu quả</li>\r\n<li>Sản phẩm được thử nghiệm trên nhiều giống chó: Golden, Corgi, Samoyed, Poodle, Labrador, Husky...</li>\r\n<li>Chất liệu cao cấp, an toàn, thiết kế chịu được lực cắn mạnh trong thời gian dài</li>\r\n<li>Độ bền cao hoàn toàn khác biệt so với các loại đồ chơi nhựa trên thị trường</li>\r\n<li>Món đồ chơi giúp làm trắng răng cho các boss</li>\r\n<li>Bơm một ít kem đánh răng dành cho chó vào bên trong, các bé vừa cắn vừa đánh răng theo cách tự nhiên, các bé không còn cảm thấy khó chịu khi \"bị đánh răng\" như trước đây.</li>\r\n</ul>'),(198,85,0,67,'Đồ chơi đánh răng cho chó'),(199,76,0,67,'<p>Đồ chơi đánh răng cho chó được làm từ cao su cao cấp, sản phẩm giúp các boss vừa xả stress vừa làm trắng răng.</p>'),(200,75,0,68,'<p><strong>Chuông huấn luyện chó mèo</strong></p>\r\n<ul>\r\n<li>Tạo thói quen cho boss khi đến giờ ăn uống hoặc hoàn thành nhiệm vụ</li>\r\n<li>Thiết kế nhỏ gọn dễ mang theo mọi lúc mọi nơi</li>\r\n<li>Tiếng chuông vừa phải, dễ chịu</li>\r\n</ul>'),(201,85,0,68,'Chuông huấn luyện chó mèo'),(202,76,0,68,'<p>Chuông huấn luyện chó mèo là món đồ chơi quen thuộc của mọi gia đình, bạn có thể tạo thói quen ăn uống hoặc nhiệm vụ cho pet khi nghe tiếng chuông.</p>'),(203,75,0,69,'<p><strong>Đồ chơi quả bóng cao su có âm thanh</strong></p>\r\n<ul>\r\n<li>Chất liệu cao su tự nhiên TPR an toàn sức khỏe, độ bền cao</li>\r\n<li>Có gắn kèn phát ra âm thanh khi thú cưng cắn vào</li>\r\n<li>Giúp chó mèo thư giãn, không còn cắn phá đồ trong nhà</li>\r\n<li>Làm sạch răng tự nhiên</li>\r\n<li>Độ đàn hồi và độ nảy tự nhiên</li>\r\n<li>Kích thước 12x6 cm</li>\r\n</ul>'),(204,85,0,69,'Đồ chơi quả bóng cao su có âm thanh'),(205,76,0,69,'<p>Đồ chơi quả bóng cao su có âm thanh, chất nhiệu cao su tự nhiên TPR an toàn và độ bền cao. Giúp chó mèo thư giản với đồ chơi, không còn cắn phá đồ đạc trong nhà.</p>'),(206,75,0,70,'<p><strong>Đồ chơi chó mèo hình gấu bông</strong></p>\r\n<ul>\r\n<li>Chất liệu sợi cotton cao cấp</li>\r\n<li>Món đồ chơi dành cho cả chó và mèo, giúp chúng thư giãn và không còn cắn phá đồ đạc trong nhà</li>\r\n<li>Có thể phát ra âm thanh bíp bíp khi cắn vào</li>\r\n<li>Kích thước 25x19 cm</li>\r\n<li>Nặng 60gr</li>\r\n</ul>'),(207,85,0,70,'Đồ chơi chó mèo gấu bông phát âm thanh'),(208,76,0,70,'<p>Đồ chơi chó mèo hình gấu bông bằng chất liệu cotton cao cấp, có khả năng phát âm thanh tạo sự hứng thú cho pet cưng.</p>'),(209,75,0,71,'<p><strong>Quả bóng đồ chơi bằng vải cho chó mèo</strong></p>\r\n<ul>\r\n<li>Đường kính 7 cm</li>\r\n<li>Chất liệu vải cotton</li>\r\n<li>Món đồ chơi làm sạch răng tự nhiên cho chó mèo, đồng thời giúp nướu khỏe hơn</li>\r\n<li>Chó mèo được thư giãn và không còn cắn phá đồ trong nhà</li>\r\n</ul>'),(210,85,0,71,'Quả bóng đồ chơi bằng vải cho chó mèo'),(211,76,0,71,'<p>Quả bóng đồ chơi bằng vải cho chó mèo, giúp làm sạch răng, chăm sóc răng trắng và nướu khỏe, đồng thời tránh trường hợp chó mèo cắn phá đồ trong nhà.</p>'),(212,75,0,72,'<p><strong>Cây cào móng cho mèo trụ đứng</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Bản chất của mèo thích cào vào các đồ vật như ghế sofa, tủ, giường... vì thế trụ cào là món đồ chơi bạn cần trang bị cho chúng</li>\r\n<li>Giúp mèo thư giãn, chơi đùa thoải mái, năng động</li>\r\n<li>Chất liệu sợi an toàn tuyệt đối</li>\r\n<li>Giúp rèn luyện sức khỏe cho mèo</li>\r\n<li>Ngăn ngừa trường hợp mèo cào các đồ đạc trong nhà</li>\r\n<li>Size M: 40x24x6.5cm</li>\r\n<li>Size L: 44x30x7cm</li>\r\n</ul>'),(213,85,0,72,'Cây cào móng cho mèo trụ đứng'),(214,76,0,72,'<p>Cây cào móng cho mèo dạng trụ đứng, kết cấu chắc chắn, giúp mèo thoải mái chơi đùa.</p>'),(215,75,0,73,'<p><strong>Đồ chơi cho mèo gắn tường</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Chất liệu nhựa PP cao cấp</li>\r\n<li>Món đồ chơi gắn vào kính, vách gỗ</li>\r\n<li>Thiết kế thanh ray có 2 quả bóng trượt bên trong</li>\r\n<li>Giúp mèo chơi đùa, thư giãn, không còn nằm buồn ủ rủ</li>\r\n<li>Kích thước 55 x 10 x 5 cm</li>\r\n</ul>'),(216,85,0,73,'Đồ chơi cho mèo gắn tường'),(217,76,0,73,'<p>Đồ chơi cho mèo gắn tường thiết kế thanh ray có quả bóng bên trong, giúp mèo thư giãn, chơi đùa theo bản tính tự nhiên</p>'),(218,75,0,74,'<p><strong>Vòi nước treo chuồng cho chó mèo</strong></p>\r\n<ul>\r\n<li>Chống bụi bẩn, côn trùng rơi vào nước</li>\r\n<li>Không bị tràn nước ra chuồng làm ước tay chân các bé chó mèo</li>\r\n<li>Thích hợp cho mọi loại chuồng</li>\r\n<li>Thích hợp tất cả các loại chai nhựa (Cocacola, pepsi, trà xanh, nước suối...)</li>\r\n<li>Chất liệu cao cấp, bền bỉ và an toàn</li>\r\n</ul>'),(219,85,0,74,'Vòi nước treo chuồng cho chó mèo'),(220,76,0,74,'<p>Vòi nước treo chuồng cho chó mèo là vật dụng cần thiết cho pet cưng của bạn, giúp giữ vệ sinh nước uống, không bị bụi bẩn, côn trùng rơi vào...</p>'),(221,75,0,75,'<p><strong>Máng uống nước thông minh ngăn bụi</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Chất liệu nhựa ABS cao cấp, an toàn</li>\r\n<li>Dung tích 1200ml</li>\r\n<li>Ngăn bụi bẩn rơi vào nguồn nước, giữ vệ sinh hơn</li>\r\n<li>Tác dụng chống sặc nước, giúp thú cưng uống nước từ từ</li>\r\n<li>Thiết kế sang trọng</li>\r\n</ul>'),(222,85,0,75,'Máng uống nước thông minh ngăn bụi 1200ml'),(223,76,0,75,'<p>Máng uống nước thông minh ngăn bụi, giúp bảo vệ nước uống của thú cưng luôn sạch sẽ và có tác dụng chống sặc nước.</p>'),(224,75,0,76,'<p><strong>Tông đơ cạo lông chó mèo Codos KP-6800</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Thương hiệu Codos</li>\r\n<li>Model KP-6800 bản nâng cấp</li>\r\n<li>Thiết kế phiên bản mới, kiểu dáng thời trang thon gọn, tạo cảm giác thoải mái khi cầm</li>\r\n<li>Lưỡi cạo nhập khẩu làm bằng thép không ghỉ, độ bền cao, cạo được mọi loại lông chó mèo</li>\r\n<li>Lưỡi cắt có thể tháo rời để vệ sinh</li>\r\n<li>Có chế độ báo dung lượng pin</li>\r\n<li>Có thể điều chỉnh chiều dài lưỡi cạo</li>\r\n<li>Sử dụng pin hoặc dùng khi cắm vào nguồn điện</li>\r\n<li>Thời gian sử dụng pin liên tục lên đến 45 phút</li>\r\n<li>Phụ kiện kèm theo: dầu bôi trơn, lượt, bàn chải làm sạch, bộ sạc</li>\r\n</ul>'),(225,85,0,76,'Tông đơ cạo lông chó mèo Codos KP-6800'),(226,76,0,76,'<p>Tông đơ cạo lông chó mèo Codos KP-6800 phiên bản nâng cấp với nhiều cải tiến vượt trội so với loại KP-6800 trước đây.</p>'),(227,75,0,77,'<p><strong>Bộ dây dắt chó màu sắc cầu vòng</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Chất liệu vải dù chắc chắn</li>\r\n<li>Màu sắc nổi bật, thời trang</li>\r\n<li>Sản phẩm bao gồm đai ngực + dây dắt</li>\r\n</ul>'),(228,85,0,77,'Bộ dây dắt chó màu sắc cầu vòng'),(229,76,0,77,'<p>Bộ dây dắt chó màu sắc cầu vòng loại vải dù chắc chắc, nhiều kích cỡ phù hợp các loại cún khác nhau.</p>\r\n<p>S: 0.6 x 120cm</p>\r\n<p>M: 0.8 x 120cm</p>\r\n<p>L: 1.0 x 120cm</p>'),(230,75,0,78,'<p><strong>Cây gạt lông chó mèo Clean</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Chất liệu nhựa ABS cao cấp</li>\r\n<li>Kích thước 18.3 x 4.3 cm</li>\r\n<li>Dùng gạt lông thú cưng dính trên quần áo, nệm, sofa..</li>\r\n<li>Thiết kế siêu nhỏ gọn, tiện dụng, dễ dàng mang theo mọi nơi</li>\r\n</ul>'),(231,85,0,78,'Cây gạt lông chó mèo Clean'),(232,76,0,78,'<p>Cây gạt lông chó mèo Clean có thiết kế siêu nhỏ gọn, tiện dụng và thời trang.</p>'),(233,75,0,79,'<p><strong>Bộ dây dắt đai ngực an toàn cho chó</strong></p>\r\n<p> </p>\r\n<p>Bộ sản phẩm bao gồm: đai và dây dắt</p>\r\n<p>Chất liệu vải lưới mềm mại, thoáng mát</p>\r\n<p>Độ an toàn cao hơn so với loại dùng vòng cổ</p>\r\n<p>Thích hợp nhiều kích thước của các giống cho khác nhau</p>'),(234,85,0,79,'Bộ dây dắt đai ngực an toàn cho chó'),(235,76,0,79,'<p>Bộ dây dắt đai ngực an toàn cho chó, tạo cảm giác dễ chịu khi toàn bộ đai ôm cả phần trước của chú cún, không bị tuột dây như loại vòng cổ.</p>'),(236,75,0,80,'<p><strong>Bát ăn nghiêng cho chó mèo trong suốt</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Chất liệu ABS cao cấp</li>\r\n<li>Thiết kế nghiêng 15 độ, mang lại sự thoải mái cho thú cưng khi ăn</li>\r\n<li>Bát trong suốt giúp bạn dễ dàng quan sát lượng thức ăn bên trong</li>\r\n<li>Phần bát có nhiều rãnh hẹp tạo sự thích thú cho chó mèo vì bản tính săn tìm đồ ăn trong kẹt của chúng</li>\r\n<li>Thích hơp cho thú cưng loại nhỏ dưới 10kg</li>\r\n</ul>'),(237,85,0,80,'Bát ăn nghiêng cho chó mèo trong suốt'),(238,76,0,80,'<p>Bát ăn nghiêng cho chó mèo có thiết kế trong suốt, giúp bạn dễ dàng quan sát lượng thức ăn bên trong. Bát ăn nghiêng 15 độ giúp thú cưng thoải mái hơn trong khi ăn.</p>'),(239,75,0,81,'<p><strong>Khăn lau chó mèo siêu thấm</strong></p>\r\n<ul>\r\n<li>Kích thước to 65x44 cm</li>\r\n<li>Chất liệu mềm mại, siêu thấm, rút ngắn thời gian lau khô</li>\r\n<li>Thiết kế thích hợp cho lông thú cưng</li>\r\n<li>Đặc điểm: sau khi để khô, khăn sẽ cứng lại chống ẩm mốc, vi khuẩn. Nên kết hợp vừa lau vừa vắt nước để giúp khăn hút tốt hơn.</li>\r\n</ul>'),(240,85,0,81,'Khăn tắm chó mèo siêu thấm (Cao cấp)'),(241,76,0,81,'<p>Khăn lau chó mèo siêu thấm, thiết kế dành riêng cho bộ lông các bé thú cưng, rút ngắn thời gian lau khô, tránh bệnh phổi cho pet yêu của bạn.</p>'),(242,75,0,82,'<p><strong>Lượt chai lông chó mèo Inox</strong></p>\r\n<ul>\r\n<li>Chất liệu Inox 304 luôn sáng bóng</li>\r\n<li>Nhiều kích thước khác nhau</li>\r\n<li>Thích hợp cho mọi loại chó mèo</li>\r\n<li>Thiết kế đơn giản, giá rẻ</li>\r\n</ul>'),(243,85,0,82,'Lượt chải lông chó mèo Inox'),(244,76,0,82,'<p>Lượt chai lông chó mèo chất liệu Inox, nhiều kích thước, sản phẩm thích hợp cho mọi loại chó mèo.</p>\r\n<p>Size S: 19x3.5 cm</p>\r\n<p>Size M: 19x4 cm</p>\r\n<p>Size L: 19x5 cm</p>'),(245,75,0,83,'<p><strong>Bộ dây dắt chó cao cấp móc nâu</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Thiết kế thời trang, nhiều màu sắc</li>\r\n<li>Chất liệu cao cấp, chắc chắn, an toàn</li>\r\n<li>Size S: 5-10 Kg</li>\r\n<li>Size M: 11-20 Kg</li>\r\n<li>Size L: 21-30 Kg</li>\r\n</ul>'),(246,85,0,83,'Bộ dây dắt chó cao cấp móc nâu'),(247,76,0,83,'<p>Bộ dây dắt chó cao cấp với thiết kế thời trang nhiều màu sắc, chất liệu dệt chắc chắn, giúp cún an toàn và thoải mái khi đi dạo.</p>'),(248,75,0,84,'<p><strong>Nhà vệ sinh cho mèo có cửa sổ</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Chất liệu nhựa ABS cao cấp, an toàn sử dụng</li>\r\n<li>Thiết kế hiện đại, sang trọng tạo điểm nhất cho không gian nhà bạn</li>\r\n<li>Có cửa sổ 1 chiều, mèo đi vào vệ sinh xong sẽ đi ra bằng cửa trên</li>\r\n<li>Cửa trên có khay lọc cát dính ở chân mèo, giúp cát không rơi ra sàn nhà</li>\r\n<li>Kích thước to phù hợp mọi loại mèo</li>\r\n</ul>'),(249,85,0,84,'Nhà vệ sinh cho mèo có cửa sổ'),(250,76,0,84,'<div class=\"desc wb-content\">\r\n<p>Nhà vệ sinh cho mèo có cửa sổ, chất liệu nhựa ABS cao cấp, thiết kế hiện đại, sang trọng.</p>\r\n</div>'),(251,75,0,85,'<p><strong>Cát vệ sinh cho mèo thủy tinh Sanicat Silica Gel</strong></p>\r\n<p> </p>\r\n<p>Sanicat là một thương hiệu đến từ Tây Ban Nha, một trong những nhà sản xuất sản phẩm chăm sóc thú cưng hàng đầu Châu Âu. Sanicat đã chăm sóc vật nuôi trên toàn thế giới với các sản phẩm sáng tạo và chất lượng hàng đầu trong hơn 30 năm qua.</p>\r\n<p>Cát thủy tinh Sanicat:</p>\r\n<p>- Loại 5 lít</p>\r\n<p>- Hạt siêu thấm hút với thời gian sử dụng lâu dài.</p>\r\n<p>- Loại bỏ mùi không mong muốn với các mùi hương khác nhau và khả năng hấp thụ lên đến 100%.</p>\r\n<p>- Cách sử dụng đơn giản và tiện lợi.</p>\r\n<p>- Giảm bụi tối đa</p>\r\n<p>- Giá cả hợp lý với mọi người sử dụng.</p>'),(252,85,0,85,'Cát vệ sinh cho mèo thủy tinh Sanicat Silica Gel'),(253,76,0,85,'<p>Cát vệ sinh cho mèo thủy tinh Sanicat Silica Gel là hạt siêu thấm hút với thời gian sử dụng lâu dài, loại bỏ mùi không mong muốn với nhiều loại hương thơm khác nhau và khả năng hấp thụ lên đến 100%.</p>\r\n<p>Dung tích: 5 lít</p>'),(254,75,0,86,'<p><strong>Nệm cho chó mèo (ổ ngủ)</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Thiết kế sang trọng</li>\r\n<li>Chất vải mềm, nhẹ, giữ ấm hiệu quả cho thú cưng</li>\r\n<li>Tạo cảm giác thoải mái nhất để chó mèo ngủ sâu</li>\r\n</ul>'),(255,85,0,86,'Nệm cho chó mèo (ổ ngủ)'),(256,76,0,86,'<p>Nệm cho chó mèo thiết kế dạng ổ để thú cưng nằm ngủ, theo bản tính tự nhiên chó mèo thích cuộn tròn nằm ngủ ở những nơi mềm và ấm.</p>\r\n<p>S: 1-5 kg</p>\r\n<p>M: 6-10 kg</p>\r\n<p>L: 11-18 kg</p>'),(257,75,0,87,'<p><strong>Khăn đeo cổ chó mèo</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Là món phụ kiện thời trang giúp thú cưng trở nên đáng yêu và sạch sẽ hơn rất nhiều.</li>\r\n<li>Chất liệu vải cotton</li>\r\n<li>Phù hợp thú cưng có cân nặng từ 3-7kg</li>\r\n</ul>'),(258,85,0,87,'Khăn đeo cổ chó mèo'),(259,76,0,87,'<p>Khăn đeo cổ chó mèo là món phụ kiện thời trang giúp thú cưng trở nên đáng yêu và sạch sẽ hơn rất nhiều.</p>'),(260,75,0,88,'<p><strong>Nơ đeo cổ chó mèo</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Chất liệu vải đẹp</li>\r\n<li>Có nhiều màu sắc phù hợp mọi cá tính của thú cưng</li>\r\n<li>Món phụ kiện thời trang nhỏ xinh mà bạn nên trang bị cho pet nhà mình</li>\r\n</ul>'),(261,85,0,88,'Nơ đeo cổ chó mèo (Nhiều màu)'),(262,76,0,88,'<p>Nơ đeo cổ chó mèo là món phụ kiện thời trang dễ thương dành cho thú cưng, thích hợp cả giống đực và giống cái.</p>'),(263,75,0,89,'<p><strong>Vòng đeo cổ chó mèo bằng da</strong></p>\r\n<ul>\r\n<li>Chất da màu đen</li>\r\n<li>Có gắn lục lạc màu bạc</li>\r\n<li>Nơ tùy chọn màu đỏ hoặc xanh</li>\r\n<li>Sản phẩm thời trang mà pet cưng của bạn nên có</li>\r\n<li>Size S: 30x1.0 cm, thích hợp chu vi cổ 15 -  22 cm</li>\r\n<li>Size M: 34x1.0 cm, thích hợp chu vi cổ 21 - 26 cm</li>\r\n</ul>'),(264,85,0,89,'Vòng đeo cổ chó mèo bằng da'),(265,76,0,89,'<p>Vòng đeo cổ chó mèo bằng da có gắn lục lạc to màu bạc, sản phẩm thời trang giúp pet cưng của bạn trở nên