6,0,208,'<p>Bàn chài tắm chó mèo cao cấp là dụng cụ giúp bạn tắm cho thú cưng sạch hơn thông thường rất nhiều.</p>'),(621,75,0,209,'<p><strong>Thuốc bổ lông chó mèo Megaderm Virbac</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: chính hãng Pháp</li>\r\n<li>Hộp 28 gói, mỗi gói 4ml</li>\r\n<li>Sản phẩm thích hợp cả chó và mèo</li>\r\n<li>Megaderm là sản phẩm thức ăn bổ sung dinh dưỡng, cung cấp vitamin E và các axit béo thiết yếu (EFA) từ các nhóm omega 3 &amp; omega 6 (với tỷ lệ lý tưởng 5:1).</li>\r\n<li>Các axit béo thiết yếu hoạt động qua 2 tác động hỗ trợ: Giúp duy trì sự hoàn thiện của da, góp phần làm giảm sưng đỏ và ngứa</li>\r\n</ul>\r\n<p><strong>Ưu điểm</strong></p>\r\n<ul>\r\n<li>Giảm ngứa và dị ứng trên da</li>\r\n<li>Giảm rụng lông, làm lành vết thương trên da</li>\r\n<li>Mượt da, lông, giảm sự tiết chất nhòn trên da</li>\r\n<li>Megaderm chứa các axit béo thiết yếu, kích thích ngon miệng </li>\r\n<li>Hỗ trợ khả năng phòng vệ tự nhiên của thú cưng</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>Hướng dẫn sử dụng</strong></p>\r\n<ul>\r\n<li>Dùng cho chó, mèo qua đường miệng: có thể cho ăn trực tiếp hoặc trộn với thức ăn.</li>\r\n<li>Liều dùng: 1 gói (4 ml) cho 10 kg thể trọng trở xuống.</li>\r\n<li>Mỗi ngày 01 gói trong trường hợp da có biển hiện bệnh, hoặc mỗi 2 ngày 01 gói để duy trì da, lông khỏe.</li>\r\n</ul>'),(622,85,0,209,'Thuốc bổ lông chó mèo Megaderm Virbac (Pháp)'),(623,76,0,209,'<p>Thuốc bổ lông chó mèo Megaderm Virbac chứa nhiều vitamin E, omega 3-6 và axit béo có tác dụng giúp mắt, lông và da khỏe mạnh.</p>'),(624,75,0,210,'<p><strong>Gel dinh dưỡng chó mèo Nutri Plus Virbac</strong></p>\r\n<ul>\r\n<li>Cân nặng 120 gram</li>\r\n<li>Xuất xứ: Pháp</li>\r\n<li>Dạng tuýp tiện lợi</li>\r\n<li>Cung cấp các khoáng chất, vitamin cần thiết hỗ trợ quá trình phát triển và cung cấp năng lượng hằng ngày cho chó mèo</li>\r\n<li>Mùi hương dễ chịu, thích hợp cho tất cả chó mèo</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>Cách dùng:</strong></p>\r\n<ul>\r\n<li>Chó lớn mỗi ngày 2-3 muỗng canh</li>\r\n<li>Chó nhỏ và mèo mỗi ngày 1-2 muỗng canh</li>\r\n<li>Thú cưng đang suy nhược hoặc vừa khỏi bệnh có thể tăng gấp đôi lượng dùng trên</li>\r\n<li>Có thể cho ăn trực tiếp hoặc trộn vào thức ăn tạo hương thơm, có tác dụng kích ăn ngon miệng</li>\r\n</ul>'),(625,85,0,210,'Gel dinh dưỡng chó mèo Nutri Plus Virbac'),(626,76,0,210,'<p>Gel dinh dưỡng chó mèo Nutri Plus Virbac nhập khẩu Pháp là sản phẩm rất cần thiết cho chó mèo ở mọi giai đoạn phát triển. Giúp phục hồi nhanh sức khỏe cho thú cưng trong quá trình điều trị bệnh.</p>'),(627,75,0,211,'<p><strong>Canxi cho chó mèo Calcium Phosphorus</strong></p>\r\n<ul>\r\n<li>Xuất xứ: USA (Mỹ)</li>\r\n<li>Dạng hộp 50 viên</li>\r\n<li>Với tỷ lệ canxi và phốt pho cân đối, bổ sung thêm vitamin D3, sản phẩm chất lượng hàng đầu mang lại sự khác biệt giúp cơ thể chó mèo hấp thu và chuyển hóa sinh học đáp ứng đủ theo nhu cầu cơ thể.</li>\r\n<li>Giúp xương chắc khỏe, phát triển vóc dáng, tránh các bệnh thiếu canxi</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>Cách dùng:</strong></p>\r\n<ul>\r\n<li>Chó: Dùng 1/2 viên mỗi ngày cho mỗi 10 kg trọng lượng. Chó đang lớn dưới 12 tháng tuổi có thể dùng gấp đôi</li>\r\n<li>Mèo: Dùng 1/4 viên mỗi ngày cho mỗi 2 kg trọng lượng. Mèo đang lớn dưới 12 tháng tuổi có thể dùng gấp đôi</li>\r\n<li>Chia nhỏ trộn vào thức ăn hoặc kẹp chung viên phô mai</li>\r\n</ul>'),(628,85,0,211,'Canxi cho chó mèo Calcium Phosphorus'),(629,76,0,211,'<p>Canxi cho chó mèo Calcium Phosphorus là sản phẩm bổ sung canxi hàng đầu cho chó mèo, nhập khẩu từ USA. Giúp chó mèo có xương chắc khỏe, phát triển vóc dáng tối đa, tránh các bệnh về xương khớp.</p>'),(630,75,0,212,'<p><strong>Sổ giun tim cho chó Heartgard Plus</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Mỹ</li>\r\n<li>Giúp phòng trị giun đũa, giun móc, đặc biệt là giun tim trên chó</li>\r\n<li>Dạng viêm mềm, có mùi thơm, cún rất dễ ăn, đây là điểm nổi bật so với các loại tẩy giun khác</li>\r\n<li>Sử dụng cho chó trên 6 tuần tuổi</li>\r\n</ul>'),(631,85,0,212,'Sổ giun tim cho chó Heartgard Plus'),(632,76,0,212,'<p>Sổ giun tim cho chó Heartgard Plus giúp phòng trị giun đũa, giun móc, đặc biệt là giun tim cho chó.</p>'),(633,75,0,213,'<p><strong>Sáp dưỡng bàn chân chó mèo Trixie</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Khối lượng 17 gram</li>\r\n<li>Chiết xuất sáp từ mật ong tự nhiên</li>\r\n<li>Dưỡng da và giữ ẩm cho bàn chân thú cưng</li>\r\n<li>Điều trị khô, nứt nẻ da bàn chân ở chó mèo</li>\r\n</ul>\r\n<p>Cách dùng: Thoa một lượng sáp vừa đủ lên lòng bàn chân thú cưng và xoa cho sáp tác dụng lên khắp phần da bàn chân. Sử dụng thường xuyên để tránh tình trạng da khô ráp, nứt nẻ.</p>'),(634,85,0,213,'Sáp dưỡng bàn chân chó mèo Trixie'),(635,76,0,213,'<p>Sáp dưỡng bàn chân chó mèo Trixie chiết xuất từ tinh chất mật ong giúp giữ ẩm và dưỡng da bàn chân cho thú cưng mềm mại, không bị nứt nẻ.</p>'),(636,75,0,214,'<p><strong>Thuốc trị ve, rận cho chó Fronil Extra</strong></p>\r\n<p> </p>\r\n<p>Xuất xứ: Công ty Vedemin Việt Nam</p>\r\n<p>Loại dung dịch nhỏ ngoài da/ nhỏ gáy</p>\r\n<p>Dùng cho chó từ 2 tháng tuổi, nặng từ 2 kg.</p>\r\n<p>Dùng được cho chó đang mang thai và cho con bú.</p>\r\n<p>Công dụng: Phòng và trị ve, rận, bọ chét cho chó</p>\r\n<p>Cách dùng:</p>\r\n<p>- Tuýp 0.67ml dùng cho chó 2-10kg (màu xanh lá)</p>\r\n<p>- Tuýp 1,34ml dùng cho chó từ 10-20kg (màu cam)</p>\r\n<p>Nhỏ thuốc lên gáy (phía sau đầu, giữa 2 vai) theo các bước sau:</p>\r\n<p>- Cân trọng lượng chó</p>\r\n<p>- Mở vỉ nhôm lấy ống thuốc</p>\r\n<p>- Mở nắp</p>\r\n<p>- Nhỏ Fronil Extra lên gáy, vạch lông để lộ phần da, để miệng ống tiếp xúc với da, nghiêng ống và bóp nhẹ từ từ đến khi hết thuốc. Sử dụng lặp lại chu kỳ mỗi tháng 1 lần.</p>'),(637,85,0,214,'Thuốc trị ve, rận, bọ chét cho chó Fronil Extra'),(638,76,0,214,'<p>Thuốc trị ve, rận cho chó Fronil Extra là dạng thuốc nhỏ giọt ngoài da (nhỏ gáy) trị ve, rận, bọ chét mọi giai đoạn cho chó.</p>\r\n<p>Mỗi hộp có 3 ống. Giá sản phẩm là giá 1 ống dùng được 1 lần.</p>'),(639,75,0,215,'<p><strong>Thuốc trị viêm tai chó mèo Vedemin 10ml</strong></p>\r\n<p> </p>\r\n<p>Xuất xứ Vedemin Việt Nam</p>\r\n<p>Dung tích 10ml</p>\r\n<p>Công dụng: đặc trị viêm tai ngoài do vi khuẩn hoặc các loại nấm thường gây bệnh ở thú cưng</p>\r\n<p>Dùng được cho cả chó và mèo</p>\r\n<p>Cách dùng:</p>\r\n<p>Lắc kỹ trước khi sử dụng</p>\r\n<p>Làm sạch và lau khô ống tai, nhỏ 10 giọt vào mỗi bên tai, mỗi ngày dùng 1 lần duy trì 7-14 ngày. Sau khi nhỏ thuốc mát-xa gốc tai thú cưng nhẹ nhàng trong 1-2 phút để thuốc thấm sâu vào bên trong tai, đồng thời giúp thú cưng dễ chịu hơn.</p>'),(640,85,0,215,'Thuốc trị viêm tai chó mèo Vedemin 10ml'),(641,76,0,215,'<div class=\"desc wb-content\">\r\n<p>Thuốc trị viêm tai chó mèo Vedemin 10ml đặc trị viêm tài ngoài do vi khuẩn và nấm gây bệnh ở thú cưng.</p>\r\n</div>'),(642,75,0,216,'<p><strong>Gel dinh dưỡng cho chó Beaphar</strong></p>\r\n<ul>\r\n<li>Xuất xứ: Hà Lan</li>\r\n<li>Khối lượng: 100gram</li>\r\n<li>Công dụng bổ sung nhiều vitamin, axit béo, các lợi khuẩn tốt cho hệ tiêu hóa</li>\r\n<li>Cung cấp năng lượng hàng ngày cho cún, tốt cho tim mạch</li>\r\n<li>Thích hợp cho cún bệnh, ăn ít, kén ăn, cần hồi phục sức khỏe</li>\r\n<li>Cách dùng: cho ăn trực tiếp hoặc trộn vào thức ăn</li>\r\n</ul>'),(643,85,0,216,'Gel dinh dưỡng cho chó Beaphar'),(644,76,0,216,'<p>Gel dinh dưỡng cho chó Beaphar có công dụng bổ sung vitamin, axit béo, các lợi khuẩn tốt cho hệ tiêu hóa. Thích hợp cho chó kén ăn, ăn ít, chó đang bệnh cần hồi phục...</p>'),(645,75,0,217,'<p><strong>Thuốc điều trị và phòng nội ngoại ký sinh cho chó Nextgard Spectra</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: nhập khẩu chính hãng Pháp (không phải hàng xách tay)</li>\r\n<li>Dùng cho chó trên 2 tháng tuổi</li>\r\n<li>Dạng viên mềm dễ ăn, vị thịt bò và ngon miệng với hầu hết các giống chó, dùng trực tiếp hoặc có thể trộn vào thức ăn.</li>\r\n<li>Điều trị nhiễm bọ chét, ve và đồng thời phòng bệnh giun tim (ấu trùng <em>Dirofilaria immitis</em>), Angiostrongylosis (bằng cách giảm mức độ nhiễm giun <em>Angiostrongylus vasorum</em> chưa trưởng thành L5 và trưởng thành) và / hoặc điều trị nhiễm giun dạ dày và ruột.</li>\r\n<li>Điều trị nhiễm bọ chét ở chó (<em>Ctenocephalides felis</em> và <em>C. canis</em>).</li>\r\n<li>Điều trị nhiễm ve ở chó (<em>Dermacentor reticulatus</em>, <em>Ixodes ricinus</em>, <em>Rhipicephalus sanguineus</em>).</li>\r\n<li>Bọ chét và ve phải ký sinh trên vật chủ và bắt đầu cắn vật chủ thì đó là căn cứ tính thời gian tiếp xúc với thành phần hoạt chất.</li>\r\n<li>Điều trị nhiễm giun trưởng thành dạ dày và ruột cho các loài: giun tròn (<em>Toxocara canis </em>và<em> Toxascaris leonina</em>), giun móc (<em>Ancylostoma caninum, Ancylostoma braziliense và Ancylostoma ceylanicum</em>) và giun tóc (<em>Trichuris vulpis</em>).</li>\r\n<li>Phòng bệnh giun tim (ấu trùng <em>Dirofilaria immitis</em>).</li>\r\n<li>Pphòng bệnh Angiostrongylosis (bằng cách giảm mức độ nhiễm giun <em>Angiostrongylus vasorum</em> chưa trưởng thành L5 và trưởng thành).</li>\r\n<li>Phòng bệnh giun tim</li>\r\n</ul>'),(646,85,0,217,'Thuốc điều trị và phòng nội ngoại ký sinh cho chó Nextgard Spectra'),(647,76,0,217,'<p>Nextgard Spectra là thuốc điều trị và phòng nội ngoại ký sinh cho chó như: bọ chét, ve, ghẻ, rận, giun tim, giun phổi, giun thực quản, và các loại giun đường tiêu hóa khác.</p>\r\n<p> </p>'),(648,75,0,218,'<p><strong>Xịt chống ve rận cho chó mèo Bioline</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Dung tích 175ml</li>\r\n<li>Công nghệ Đức</li>\r\n<li>Thành phiên chiết xuất 100% từ thiên nhiên</li>\r\n<li>Dùng cho chó mèo trên 2 tháng tuổi</li>\r\n<li>Xịt trực tiếp lên lông, khu vực ở, chuồng, nệm... để tiêu diệt ký sinh ve, rận, bọ chét.</li>\r\n<li>Duy trì 5-7 ngày để có hiệu quả tốt nhất</li>\r\n</ul>'),(649,85,0,218,'Xịt chống ve rận cho chó mèo Bioline'),(650,76,0,218,'<p>Xịt chống ve rận cho chó mèo Bioline trực tiếp diệt các loại côn trùng ký sinh trên chó nhanh chóng, hiệu quả.</p>'),(651,75,0,219,'<p><strong>Gel dinh dưỡng cho mèo Beaphar</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hà Lan</li>\r\n<li>Khối lượng: 100 gram</li>\r\n<li>Dùng được cho tất cả loại mèo từ 3 tháng tuổi</li>\r\n<li>Nguyên liệu: Sữa và các dẫn xuất từ sữa, dầu và chất béo, dẫn xuất nguồn gốc thực vật, các nấm men có lợi, các khoáng chất, các loại ngũ cốc.</li>\r\n</ul>\r\n<p><strong>HƯỚNG DẪN SỬ DỤNG</strong></p>\r\n<ul>\r\n<li>Dành cho mèo biếng ăn, mèo thiếu dinh dưỡng hoặc vừa khỏi bệnh cần hồi phục</li>\r\n<li>Có thể trộn chung với thức ăn hoặc cho ăn trực tiếp.</li>\r\n</ul>\r\n<p><strong>Liều lượng cho ăn 1 ngày</strong> cho mèo dưới 10kg: 3-5 gram/ngày</p>\r\n<p><strong>Bảo quản</strong></p>\r\n<p>Vận chuyển và bảo quản dưới 25<sup>o</sup>C.</p>\r\n<p>Không để trong tủ lạnh.</p>'),(652,85,0,219,'Gel dinh dưỡng cho mèo Beaphar'),(653,76,0,219,'<p>Gel dinh dưỡng cho mèo Beaphar Multi Vitamin Paste Cat chứa các vitamin và dưỡng chất giúp mèo khỏe mạnh, ngoài ra còn chứa Taurine – một chất thiết yếu cho sự sống của mèo nhưng bản thân chúng không tự tổng hợp được.</p>'),(654,75,0,220,'<p><strong>Gel dinh dưỡng cho mèo, trị búi lông Beaphar</strong></p>\r\n<ul>\r\n<li>Xuất xứ: Hà Lan</li>\r\n<li>Khối lượng: 100gram</li>\r\n<li>Công dụng trị búi lông ở mèo, bổ sung nhiều vitamin, axit béo, các lợi khuẩn tốt cho hệ tiêu hóa. <em>(Búi lông là chứng bệnh thường xuyên xảy ra ở mèo, do đặt tính chúng thường xuyên liếm lông, lông vón cục trong đường tiêu hóa, gây nhiều triệu chứng khó tiêu...)</em></li>\r\n<li>Thực phẩm chức năng cung cấp năng lượng hàng ngày cho mèo</li>\r\n<li>Cách dùng: cho ăn trực tiếp hoặc trộn vào thức ăn</li>\r\n</ul>'),(655,85,0,220,'Gel dinh dưỡng cho mèo, trị búi lông Beaphar'),(656,76,0,220,'<p>Gel dinh dưỡng cho mèo Beaphar giúp đào thải búi lông, bổ sung vitamin, axit béo, các lợi khuẩn tốt cho hệ tiêu hóa.</p>'),(657,75,0,221,'<p><strong>Thuốc Broadline phòng trị nội ngoại ký sinh trùng cho mèo</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Nhập khẩu chính hãng Pháp (không phải hàng xách tay)</li>\r\n<li>Dùng cho mèo trên 2 tháng tuổi</li>\r\n<li>Thuốc dùng ngoài da (nhỏ gáy)</li>\r\n<li>Quy cách đóng gói: 1 hộp 3 ống</li>\r\n</ul>\r\n<p><strong>CÔNG DỤNG: </strong>Phòng trị nội, ngoại ký sinh trùng trên mèo.</p>\r\n<p><strong>Ngoại ký sinh</strong></p>\r\n<p>+ Trị và phòng ngừa nhiễm bọ chét (<em>Ctenocephalides felis</em>). Loại bỏ bọ chét trong 24 giờ.</p>\r\n<p>+ Phòng bọ chét bằng cách ức chế sự phát triển của bọ chét chưa trưởng thành (trứng, ấu trùng và nhộng).</p>\r\n<p>+ Sản phẩm được sử dụng như một phương pháp để điều trị dị ứng da do bọ chét.</p>\r\n<p>+ Trị và phòng ngừa nhiễm ve (<em>Ixodes ricinus</em>). Loại bỏ ve trong 48 giờ.</p>\r\n<p>+ Điều trị ghẻ mặt (<em>Notoedres cati</em>)</p>\r\n<p>+ Phòng ghẻ tai <em>(Otodectes cynotis)</em></p>\r\n<p><strong>Sán dây</strong></p>\r\n<p>+ Điều trị nhiễm sán dây (<em>Dipylidium caninum</em>, <em>Taenia taeniaeformis</em>, <em>Echinococcus multilocularis</em>, <em>Joyeuxiella pasqualei (trưởng thành), Joyeuxiella fuhrmanni (trưởng thành).</em></p>\r\n<p><strong>Giun tròn</strong></p>\r\n<p>+ Điều trị nhiễm giun tròn đường tiêu hóa (ấu trùng L3, L4 và giun trưởng thành <em>Toxocara cati</em>, ấu trùng L4 và giun trưởng thành <em>Ancylostoma tubaeforme</em>, và giun trưởng thành <em>Toxascaris leonina</em> và <em>Ancylostoma brazilienze</em>).</p>\r\n<p>+ Điều trị nhiễm giun phổi ở mèo (ấu trùng L3, L4, giun trưởng thành <em>Aelurostrongylus abstrusus</em>; ấu trùng L4 và giun trưởng thành <em>Troglostrongylus brevior</em>).</p>\r\n<p>+ Điều trị nhiễm giun bàng quang (<em>Capillaria plica</em>).</p>\r\n<p>+ Phòng ngừa bệnh giun tim (ấu trùng của <em>Dirofilaria immitis</em>)</p>\r\n<p><strong>CÁCH DÙNG:</strong></p>\r\n<ul>\r\n<li>Dùng kéo cắt dọc vỉ theo đường chấm, sau đó kéo nắp.</li>\r\n<li>Tháo ống từ gói và giữ nó thẳng đứng.</li>\r\n<li>Kéo nhẹ pít tông theo chiều ngược, vặn và mở nắp.</li>\r\n<li>Rẽ lông mèo trên đường giữa cổ, giữa hộp sọ và xương bả vai đến khi nhìn thấy da.</li>\r\n<li>Đặt đầu ống thuốc lên da và bóp toàn bộ thuốc tại một điểm trực tiếp trên da.</li>\r\n<li>Sản phẩm nên dùng cho vùng da khô nơi mà mèo không thể liếm được thuốc. Đối với những giống mèo lông dài, đặc biệt cần chú ý nên bôi sản phẩm lên da và không phải lên lông để đảm bảo hiệu quả tối ưu.</li>\r\n</ul>\r\n<p><strong>CHÚ Ý</strong></p>\r\n<p><u>Cảnh báo đặc biệt cho loài chỉ định</u></p>\r\n<ul>\r\n<li>Tránh động vật liếm nhau sau khi điều trị.</li>\r\n<li>Không nên tắm cho động vật trong 2 ngày sau khi điều trị.</li>\r\n<li>Để giảm sự tái nhiễm từ bọ chét mới, khuyến cáo nên điều trị tất cả mèo trong nhà. Những động vật khác trong cùng nhà cũng nên điều trị với sản phẩm phù hợp.</li>\r\n<li>Trong trường hợp nhiễm bọ chét nhiều trong nhà và nên xử lý bằng sản phẩm môi trường phù hợp và sau đó hút bụi thường xuyên.</li>\r\n</ul>\r\n<p> </p>\r\n<p><u>Phòng ngừa khi sử dụng cho động vật</u></p>\r\n<ul>\r\n<li>Chỉ dùng bôi ngoài da. Không tiêm, không uống hoặc thông qua bất kỳ đường nào khác. Tránh tiếp xúc với mắt mèo.</li>\r\n<li>Các sản phẩm thuốc thú y không dùng cho chó</li>\r\n</ul>\r\n<p> </p>\r\n<p><u>Mang thai và cho con bú</u></p>\r\n<ul>\r\n<li>Sự an toàn của sản phẩm thuốc thú y không được chứng minh trong suốt quá trình mang thai và cho con bú. Những nghiên cứu ở phòng thí nghiệm về hoạt động từng cá thể trên chuột và thỏ thì không có tác động gây quái thai, ngộ độc thai hoặc ngộ độc thai sản. Chỉ sử dụng theo đánh giá lợi ích – nguy cơ của các bác sỹ thú y được kê toa.</li>\r\n</ul>\r\n<p> </p>\r\n<p><u>Quá liều (triệu chứng)</u></p>\r\n<ul>\r\n<li>An toàn đã được chứng minh lên đến 5 lần với liều thuốc tối đa</li>\r\n<li>Mèo nhiễm giun tim trưởng thành được điều trị lên đến 3 lần với liều thuốc tối đa (ví dụ: lên đến 9 lần với liều khuyến cáo), cứ 4 tuần điều trị 3 lần, mà không có bất kỳ phản ứng phụ.</li>\r\n</ul>\r\n<p>Hủy ống đựng thuốc sau khi sử dụng và thuốc không sử dụng theo quy định của chất thải nguy hại hiện hành.</p>\r\n<p><strong>CHỐNG CHỈ DỊNH</strong></p>\r\n<p>Không sử dụng thuốc Broadline cho động vật bị bệnh (ví dụ như hệ thống các bệnh, sốt) hoặc động vật mới khỏi bệnh.</p>\r\n<p>Không sử dụng cho thỏ.</p>\r\n<p>Không sử dụng trong các trường hợp quá mẫn với các hoạt chất hoặc bất kỳ các tá dược.</p>'),(658,85,0,221,'Thuốc Broadline phòng trị nội ngoại ký sinh trùng cho MÈO'),(659,76,0,221,'<p>Thuốc Broadline là một sản phẩm phòng trị nội ngoại ký sinh trùng cho mèo được tin dùng trên toàn thế giới. Sản phẩm được kiểm định và nhập khẩu chính hãng từ Pháp (không phải hàng xách tay).</p>'),(660,75,0,222,'<p><strong>Sữa tắm khô chó mèo Tropiclean</strong></p>\r\n<p> </p>\r\n<p>Sữa tắm khô chó mèo Tropiclean làm sạch lông không cần dùng nước sử dụng tuỳ ý trong ngày, bất cứ khi nào bạn cần làm sạch cho bé.</p>\r\n<ul>\r\n<li>Xuất xứ: Mỹ</li>\r\n<li>Dung tích: 220ml</li>\r\n<li>Dùng cho chó mèo mọi lứa tuổi</li>\r\n<li>Hương dâu / hương dừa</li>\r\n</ul>\r\n<p>Dầu tắm đa chức năng mà mỗi chủ nuôi đều cần để trang bị cho thú cưng mỗi khi cần thiết: </p>\r\n<ul>\r\n<li>Khi thú cưng BỆNH không thể tắm ướt</li>\r\n<li>Khi chó mèo đang mang thai</li>\r\n<li>Khi pet của bạn quá sợ nước (nhất là các quàng thượng đỏng đảnh)</li>\r\n<li>Khi boss quá quậy phá, vừa tắm xong đã bẩn lại</li>\r\n<li>Khi đi du lịch cần làm sạch bất kì lúc nào</li>\r\n<li>Khi cần làm sạch chân cho bé khi lên giường, hoặc lên ô tô</li>\r\n<li>Khi cần diệt khuẩn cho bé mỗi tối trước khi đi ngủ cùng bạn</li>\r\n<li>Khi cần diệt khuẩn nhanh do vừa tiếp xúc với các pet và người lạ ngoài đường</li>\r\n</ul>\r\n<p>Cách dùng:</p>\r\n<ul>\r\n<li>Nhấn xịt lượng vừa đủ lên lông thú</li>\r\n<li>Lấy khăn massage 2-3 phút cho các chất bẩn chuyển sang khăn / hoặc dùng tay massage cho đến khi lông khô.</li>\r\n<li>Dùng lược chải tơi lông của bé lên hoặc để tự nhiên.</li>\r\n</ul>'),(661,85,0,222,'Sữa tắm khô chó mèo Tropiclean'),(662,76,0,222,'<p>Sữa tắm khô chó mèo Tropiclean làm sạch lông không cần dùng nước sử dụng tuỳ ý trong ngày, bất cứ khi nào bạn cần làm sạch cho bé.</p>'),(663,75,0,223,'<p><strong>Dầu xả cho chó mèo lông bóng mượt Tropiclean</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Mỹ</li>\r\n<li>Dung tích: 473ml</li>\r\n<li>Dùng cho chó mèo mọi lứa tuổi</li>\r\n<li>Sản phẩm với chiết xuất thực vật và các Vitamin thiết yếu giúp cho bộ lông thú cưng bóng mượt, mềm mại.</li>\r\n<li>Sự kết hợp Gừng, Vani và kem dưỡng ẩm thực vật giúp cải thiện đáng kể bộ lông xơ xác, giữ ẩm cho làn da thú cưng.</li>\r\n<li>Thành phần 100% thiên nhiên: Nước, Rượu tự nhiên, đạm Lúa mì thủy phân, Hoa sứ, Gừng, Vitamin E, Yến mạch, Pro - Vitamin B5, Dưa leo, Vani.</li>\r\n</ul>'),(664,85,0,223,'Dầu xả cho chó mèo lông bóng mượt Tropiclean'),(665,76,0,223,'<div class=\"desc wb-content\">\r\n<p>Dầu xả cho chó mèo lông bóng mượt Tropiclean với chiết xuất thực vật và các Vitamin thiết yếu giúp cho bộ lông thú cưng bóng mượt, mềm mại.</p>\r\n</div>'),(666,75,0,224,'<p><strong>Sữa tắm trị ngứa, viêm da chó mèo Oxymed Tropiclean</strong></p>\r\n<p> </p>\r\n<p>Xuất xứ Mỹ</p>\r\n<p>Dung tích lớn 592ml</p>\r\n<p>Dùng được cho chó và mèo trên 2 tháng tuổi</p>\r\n<ul>\r\n<li>Sản phẩm có công thức đặc biệt giúp làm dịu và tái tạo làn da khô và kích ứng.</li>\r\n<li>Axit Salicylic tự nhiên giúp loại bỏ tế bào chết, vảy gàu và các vấn đề liên quan đến tiết bả nhờn.</li>\r\n<li>Bột yến mạch, cây tràm trà và Vitamin E, giúp chữa lành và giảm sưng các vết đỏ trên da.</li>\r\n<li>Dùng dầu gội này thường xuyên sẽ giúp mang đến cho thú cưng một làn da và lông mềm mượt, sáng bóng.</li>\r\n</ul>\r\n<p>Thành phần chính: Không chứa xà phòng (soap free).</p>\r\n<p>Nước, keo bột yến mạch, chất tẩy rửa dịu nhẹ có nguồn gốc từ dừa, Beta Hydroxy Salicylic acid, nha đam, protein lúa mì thủy phân, cây Yucca, cây tràm trà, Vitamin E. </p>'),(667,85,0,224,'Sữa tắm trị ngứa, viêm da chó mèo Oxymed Tropiclean'),(668,76,0,224,'<p>Sữa tắm trị ngứa, viêm da chó mèo Oxymed Tropiclean có thành phần 100% từ thiên nhiên. Với công thức đặc biệt giúp làm dịu và tái tạo làn da khô, kích ứng, giảm ngứa khi thú cưng bị viêm da, đốm đỏ...</p>'),(669,75,0,225,'<p><strong>Sữa tắm chó mèo da nhạy cảm Tropiclean (Mỹ)</strong></p>\r\n<p>Xuất xứ: Mỹ (Thương hiệu bán chạy #1 trên Amazon)</p>\r\n<p>Dung tích: 500ml</p>\r\n<p>Dùng cho cả chó và mèo, thích hợp chó mèo có làn da nhạy cảm.</p>\r\n<p>Dầu gội SPA hương PURE hoa sứ với những thành phần làm sạch tự nhiên, không xà phòng hay hoá chất, giúp nuôi dưỡng làn da thú cưng khoẻ mạnh và làm cho bộ lông của chúng mềm mại ,bồng bềnh và sạch bóng.</p>\r\n<p>Đặc biệt, sản phẩm không gây dị ứng, không làm cay mắt nên vô cùng hữu ích với các bé có làn da nhạy cảm, dễ dị ứng và hoàn hảo cho các boss.</p>\r\n<p><strong>Thành phần 100% thiên nhiên:</strong> Nước, hỗn hợp hữu cơ gồm yến mạch &amp; hoa sứ, chất làm sạch dịu nhẹ chiết xuất từ Dừa, Vitamin E.</p>\r\n<p> </p>\r\n<p><strong>Cách dùng:</strong> Làm ướt đều lông thú cưng và thoa lên một lượng dầu vừa đủ, massage đều khắp bộ lông từ 5 phút rồi xả thật sạch.Sau đó lau và sấy khô thú cưng bằng khăn. Có thể tắm cho bé thường xuyên 2 lần/tuần để giữ bộ lông óng ả, mềm mượt.</p>'),(670,85,0,225,'Sữa tắm chó mèo da nhạy cảm Tropiclean (Mỹ)'),(671,76,0,225,'<p>Sữa tắm dành cho chó mèo có làn da nhạy cảm Tropiclean (Mỹ) với những thành phần làm sạch tự nhiên, không xà phòng hay hoá chất, giúp nuôi dưỡng làn da thú cưng khoẻ mạnh</p>'),(672,75,0,226,'<p><strong>Dầu gội và xả cho chó BUDLE</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Dung tích: 500ml</li>\r\n<li>Dùng cho tất cả loại chó, ở mọi lứa tuổi</li>\r\n</ul>\r\n<h4><strong>Đặc điểm nổi bật</strong></h4>\r\n<p>Dẩu gội và xả cho chó Budle’Budle thuộc dòng sản phẩm chăm sóc da và lông chó. Được điều chế từ các nguyên liệu thiên nhiên, giúp cún cưng nhà bạn có một làn da sạch khỏe và một bộ lông mượt mà.</p>\r\n<ul>\r\n<li>Thành phần đặc biệt: tinh dầu jojoba và chiết xuất lá thường xuân</li>\r\n<li>Công dụng: bảo vệ bộ lông của chú chó khỏi các tác nhân gây dị ứng trong môi trường</li>\r\n<li>Giữ ẩm và tăng độ óng ả cho lông, phục hồi hư tổn, cho lông thêm bóng mượt</li>\r\n<li>Chứa tinh chất trà xanh hữu cơ và cây mê điệt</li>\r\n<li>Hương thơm thanh mát và lôi cuốn</li>\r\n<li>Chiết xuất từ thảo mộc hữu cơ được chứng nhận ECOCERT</li>\r\n</ul>\r\n<h4> </h4>\r\n<p><strong>Thành phần hữu cơ tự nhiên, tuyệt đối an toàn và tốt cho sức khỏe</strong></p>\r\n<p>Là sự kết hợp tiện dụng gồm cả dầu gội và dầu xả dùng chung cho các giống chó. Tinh dầu jojoba bảo vệ và bộ lông của chú chó nhỏ tránh khỏi các tác nhân gây dị ứng bên ngoài, tẩy sạch vượt trội bụi bẩn trên lông. Chiết xuất lá thường xuân giúp giữ ẩm và tăng độ óng ả cho lông, phục hồi bộ lông hư tổn, cải thiện tình trạng xơ rối, giúp cho bộ lông thú cưng ngày càng bóng đẹp, mượt mà.</p>\r\n<p><strong>Làm sạch da, lông khỏi bụi bẩn, vi khuẩn, ký sinh trùng</strong></p>\r\n<p>Sản phẩm mang lại vẻ đẹp hoàn hảo cho các chú chó chỉ với một bước đơn giản. Sự kết hợp độc đáo dầu gội và xả mang đến bộ lông mềm mại và óng mượt. Chiết xuất từ trà xanh hữu cơ và cây mê điệt giúp làm sạch và nuôi dưỡng bộ lông khỏe mạnh.</p>'),(673,85,0,226,'Dầu gội và xả cho chó BUDLE'),(674,76,0,226,'<p>Dầu gội và xả cho chó BUDLE được điều chế từ các nguyên liệu thiên nhiên, giúp cún cưng nhà bạn có một làn da sạch khỏe và một bộ lông mượt mà.</p>'),(675,75,0,227,'<p><strong>Sữa tắm Yú chính hãng 400ml</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Đài Loan (nhập khẩu chính hãng)</li>\r\n<li>Dung tích 400ml</li>\r\n<li>Có 10 mùi hương khác nhau</li>\r\n<li>Ưu điểm nổi bật: mùi thơm lâu, giúp lông thú cưng mềm mượt, dùng được cho cả chó, chó con, mèo và mèo con</li>\r\n</ul>'),(676,85,0,227,'Sữa tắm Yú chính hãng 400ml'),(677,76,0,227,'<p>Sữa tắm Yú nhập khẩu Đài Loan cam kết chính hãng, có tem nhãn phụ xuất xứ sản phẩm. Đây là loại sữa tắm cao cấp được rất nhiều người trên thế giới lựa chọn sử dụng cho thú cưng.</p>'),(678,75,0,228,'<p><strong>Sữa tắm chó mèo Bioline</strong></p>\r\n<p>Được bào chế từ tinh dầu tự nhiên thích hợp cho làn da và bộ lông của thú cưng. Giúp làm sạch và mượt lông vượt trội, bảo vệ da từ sâu bên trong, khử mùi hôi hiệu quả.</p>\r\n<ul>\r\n<li>Công nghệ Đức</li>\r\n<li>Dung tích 250ml</li>\r\n<li>Dành cho chó và mèo</li>\r\n<li>Cách dùng: Nhẹ nhàng làm ướt bộ lông thú cưng, cho dầu tắm đã pha loãng với nước lên khắp bề mặt cơ thể chúng, massage nhẹ nhàng khắp cơ thể từ 3-5 phút sau đó xả lại bằng nước sạch</li>\r\n</ul>'),(679,85,0,228,'Sữa tắm chó mèo Bioline (Công nghệ Đức)'),(680,76,0,228,'<div class=\"desc wb-content\">\r\n<p>Sữa tắm chó mèo Bioline giúp bộ lông thú cưng sạch và bóng mượt, hương thơm dễ chịu, khử mùi hôi hiệu quả.</p>\r\n</div>'),(681,75,0,229,'<p><strong>Sữa tắm cho mèo con Lee&amp;Webster</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Khối lượng: 280 gram</li>\r\n<li>Dành cho mèo con dưới 6 tháng tuổi</li>\r\n</ul>\r\n<h4><strong>Đặc điểm nổi bật </strong></h4>\r\n<p>Dầu gội và xả mèo con Lee&amp;Webster thuộc dòng sản phẩm chăm sóc da và lông mèo. Các dược liệu hữu cơ tự nhiên, cực kỳ êm dịu cho làn da nhạy cảm của mèo con. Dầu gội và xả mèo con giúp ổn định và cân bằng độ ẩm, giúp bảo vệ lớp lông tơ non nớt, cung cấp dưỡng chất cần thiết để chú mèo có một chiếc áo lông thật đẹp đẽ và khỏe mạnh khi lớn lên.</p>\r\n<ul>\r\n<li>Dầu gội và xả đặc biệt dành riêng cho các chú mèo con 8 tuần - 18 tháng tuổi</li>\r\n<li>Nguyên liệu từ thiên nhiên: mê điệt, trà xanh, chiết xuất thảo dược…</li>\r\n<li>Cân bằng pH, làm mềm da, mượt lông</li>\r\n<li>Chống vi khuẩn hiệu quả, cung cấp dưỡng chất nuôi dưỡng da và lông phát triển</li>\r\n<li>Không gây kích ứng da, duy trì độ ẩm</li>\r\n<li>Chăm sóc làn da nhạy cảm và lớp lông tơ non nớt của những chú mèo con</li>\r\n<li>Hương thơm dịu dàng giúp các chú mèo con giảm stress</li>\r\n</ul>'),(682,85,0,229,'Sữa tắm cho mèo con Lee&Webster'),(683,76,0,229,'<p>Sữa tắm cho mèo con Lee&amp;Webster giúp ổn định và cân bằng độ ẩm, giúp bảo vệ lớp lông tơ non nớt, cung cấp dưỡng chất cần thiết để chú mèo có một chiếc áo lông thật đẹp đẽ và khỏe mạnh khi lớn lên.</p>'),(684,75,0,230,'<p><strong>Sữa tắm trị gàu cho chó mèo Budle</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Dung tích: 300ml</li>\r\n<li>Dành cho chó mèo mọi lứa tuổi bị gàu, vảy gàu</li>\r\n</ul>\r\n<h4><strong>Đặc điểm nổi bật </strong></h4>\r\n<p>Dầu gội trị gàu cho chó Budle’Budle Dandruff Shampoo thuộc dòng sản phẩm dầu gội đặc trị các bệnh về da cho chó. 17 loại thảo dược phương Đông được lựa chọn kỹ càng và bào chế nên Budle’Budle Dandruff Shampoo, giúp dưỡng ẩm cho làn da khô bong tróc của thú cưng, làm dịu ngứa, lành vết thương, bảo vệ thú cưng nhà bạn khỏi kích ứng và rụng lông quá mức do thời tiết, vi khuẩn…</p>\r\n<ul>\r\n<li>Dầu gội trị gàu dùng cho mọi giống chó và mèo</li>\r\n<li>Dùng cho thú cưng trên 12 tuần tuổi</li>\r\n<li>Thành phần từ tự nhiên: chiết xuất thảo dược Đông y</li>\r\n<li>Điều trị các bệnh về nhiễm trùng da, mẩn ngứa và khô da</li>\r\n<li>Làm mềm da, ngăn chặn sự lan rộng của gàu, vẩy nến</li>\r\n<li>Giúp vệ sinh sạch sẽ, loại bỏ da chết và giảm thiểu mùi hôi cơ thể</li>\r\n<li>Dưỡng lông, giảm tình trạng rụng lông quá mức, cho thú cưng bộ lông mềm mượt</li>\r\n<li>Dưỡng ẩm, phục hồi da khô nẻ, giúp thú cưng có làn da khỏe mạnh</li>\r\n</ul>'),(685,85,0,230,'Sữa tắm trị gàu cho chó mèo Budle'),(686,76,0,230,'<p>Sữa tắm trị gàu cho chó mèo Budle dùng cho mọi giống chó và mèo mọi lứa tuổi,.giúp dưỡng ẩm cho làn da khô bong tróc của thú cưng, làm dịu ngứa, lành vết thương.</p>'),(687,75,0,231,'<p><strong>Nước hoa thú cưng Science</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Nhanh chóng khử mùi hôi chó mèo, lưu hương thơm dài lâu</li>\r\n<li>Giúp thú cưng trở nên sạch sẽ, đáng yêu và dễ gần gũi hơn</li>\r\n<li>Giải pháp cho những lúc bận rộn, lúc thú cưng bệnh... cơ thể có mùi hôi nhưng bạn chưa thể tắm cho chúng hoặc khi đi du lịch</li>\r\n<li>Dung tích 50ml</li>\r\n</ul>'),(688,85,0,231,'Nước hoa thú cưng Science'),(689,76,0,231,'<div class=\"desc wb-content\">\r\n<p>Nước hoa thú cưng Science giúp nhanh chóng khử mùi hôi chó mèo, lưu hương thơm dài lâu, giúp thú cưng trở nên sạch sẽ và đáng yêu.</p>\r\n</div>'),(690,75,0,232,'<p><strong>Nước hoa thú cưng Science</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Nhanh chóng khử mùi hôi chó mèo, lưu hương thơm dài lâu</li>\r\n<li>Giúp thú cưng trở nên sạch sẽ, đáng yêu và dễ gần gũi hơn</li>\r\n<li>Giải pháp cho những lúc bận rộn, lúc thú cưng bệnh... cơ thể có mùi hôi nhưng bạn chưa thể tắm cho chúng hoặc khi đi du lịch</li>\r\n<li>Dung tích 50ml</li>\r\n</ul>'),(691,85,0,232,'Nước hoa thú cưng Science'),(692,76,0,232,'<div class=\"desc wb-content\">\r\n<p>Nước hoa thú cưng Science giúp nhanh chóng khử mùi hôi chó mèo, lưu hương thơm dài lâu, giúp thú cưng trở nên sạch sẽ và đáng yêu.</p>\r\n</div>'),(693,75,0,233,'<p><strong>Nước hoa thú cưng Science</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Nhanh chóng khử mùi hôi chó mèo, lưu hương thơm dài lâu</li>\r\n<li>Giúp thú cưng trở nên sạch sẽ, đáng yêu và dễ gần gũi hơn</li>\r\n<li>Giải pháp cho những lúc bận rộn, lúc thú cưng bệnh... cơ thể có mùi hôi nhưng bạn chưa thể tắm cho chúng hoặc khi đi du lịch</li>\r\n<li>Dung tích 50ml</li>\r\n</ul>'),(694,85,0,233,'Nước hoa thú cưng Science'),(695,76,0,233,'<div class=\"desc wb-content\">\r\n<p>Nước hoa thú cưng Science giúp nhanh chóng khử mùi hôi chó mèo, lưu hương thơm dài lâu, giúp thú cưng trở nên sạch sẽ và đáng yêu.</p>\r\n</div>'),(696,75,0,234,'<p><strong>Nước hoa thú cưng Science</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Nhanh chóng khử mùi hôi chó mèo, lưu hương thơm dài lâu</li>\r\n<li>Giúp thú cưng trở nên sạch sẽ, đáng yêu và dễ gần gũi hơn</li>\r\n<li>Giải pháp cho những lúc bận rộn, lúc thú cưng bệnh... cơ thể có mùi hôi nhưng bạn chưa thể tắm cho chúng hoặc khi đi du lịch</li>\r\n<li>Dung tích 50ml</li>\r\n</ul>'),(697,85,0,234,'Nước hoa thú cưng Science'),(698,76,0,234,'<div class=\"desc wb-content\">\r\n<p>Nước hoa thú cưng Science giúp nhanh chóng khử mùi hôi chó mèo, lưu hương thơm dài lâu, giúp thú cưng trở nên sạch sẽ và đáng yêu.</p>\r\n</div>'),(699,75,0,235,'<p><strong>Xịt khử mùi diệt khuẩn chó mèo Natural Clean</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Dung tích: 500ml</li>\r\n<li>Vật nuôi: Chó, mèo, chim, thú nhỏ, bò sát</li>\r\n</ul>\r\n<p> </p>\r\n<h4><strong>Đặc điểm nổi bật </strong></h4>\r\n<ul>\r\n<li>Xịt khử mùi diệt khuẩn trong gia đình, nhà ở…</li>\r\n<li>Hương hoa nhài nhẹ nhàng êm dịu</li>\r\n<li>100% thành phần hữu cơ thiên nhiên</li>\r\n<li>Khử mùi tuyệt vời, mang lại bầu không khí trong lành</li>\r\n<li>Hiệu quả, an toàn, nhanh chóng, tiện dụng</li>\r\n<li>Khử sạch mùi hôi trên cơ thể thú cưng</li>\r\n<li>Loại bỏ nhanh chóng và triệt để đến 99.9% các loại vi khuẩn</li>\r\n</ul>\r\n<h4> </h4>\r\n<p> </p>\r\n<p><strong>Sản phẩm được sản xuất theo công thức đặc biệt chứa 100% thành phần tự nhiên</strong></p>\r\n<p>Sáp ong có tác dụng chống vi khuẩn, chống nấm, chống virus với chất kháng sinh tự nhiên. Phytoncide có tác dụng ức chế sự sinh sản của vi khuẩn. Sản phẩm là sự kết hợp từ các thành phần thiên nhiên, với hương thơm đặc trưng từ loài hoa nhài thơm mát.</p>\r\n<p>Natural &amp; Clean không chứa các chất bảo quản paraben, sulfate, thuốc nhuộm hoá học, mùi nhân tạo, không độc hại ngay cả khi phun trực tiếp vào cơ thể, an toàn cho các thành viên trong gia đình đặc biệt là gia đình có người già và trẻ nhỏ.</p>\r\n<p><strong>Hiệu quả diệt khuẩn đã được kiếm nghiệm và chứng nhận</strong></p>\r\n<p>Natural &amp; Clean được chứng minh trong phòng thí nghiệm có thể loại bỏ 99,9% các vi khuẩn khác nhau, các loại nấm, các loại virus bao gồm: cúm lợn, SAS, E.Coli, Staphylococcus aureus, Salmonella, Pseudomonas aeruginosa. Tác dụng diệt khuẩn nhanh chóng chỉ trong 5 phút.</p>\r\n<p><strong>Công nghệ khử mùi hôi độc đáo</strong></p>\r\n<p>Natural &amp; Clean khử mùi bằng phương thức thâm nhập hấp phụ. Các phân tử khử mùi khi phát tán sẽ hấp phụ trực tiếp vào các phân tử gây ra mùi hôi, thay đổi cấu trúc của nó và nhanh chóng loại bỏ mùi khó chịu. Nhờ vậy Natural &amp; Clean có thể khử mùi ở bất cứ nơi nào có mùi hôi: quần áo, đệm lót, đồ chơi, các vật dụng khác, khu vực sinh hoạt của thú cưng, toilet, nón bảo hiểm, xe hơi, cốp xe máy v.v…</p>'),(700,85,0,235,'Xịt khử mùi diệt khuẩn chó mèo Natural Clean'),(701,76,0,235,'<p>Xịt khử mùi diệt khuẩn chó mèo Natural Clean được sản xuất theo công thức đặc biệt chứa 100% thành phần tự nhiên. Xịt khử mùi diệt khuẩn trong gia đình, nhà ở…hiệu quả, an toàn, nhanh chóng, tiện dụng.</p>'),(702,75,0,236,'<p><strong>Tinh dầu dưỡng lông thú cưng Show Queen</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Dung tích 100ml</li>\r\n<li>Hàng chính hãng</li>\r\n<li>Dùng được cho chó và mèo từ 2 tháng tuổi</li>\r\n<li>Giữ mùi thơm lâu trên lông thú cưng như đi spa</li>\r\n<li>Giúp lông chó mèo mềm và bóng mượt tự nhiên</li>\r\n</ul>\r\n<p>Cách dùng:</p>\r\n<p>- Sau khi tắm và sấy khô thú cưng, xịt vào lòng bàn tay 1 lần và thoa đều lên bộ lông từ phàn gáy dọc theo lưng thú cưng.</p>\r\n<p>- Nếu chó mèo có kích thước lớn, bạn có thể xịt thêm 1 lần nữa</p>'),(703,85,0,236,'Tinh dầu dưỡng lông thú cưng Show Queen'),(704,76,0,236,'<div class=\"desc wb-content\">\r\n<p>Tinh dầu dưỡng lông thú cưng Show Queen hàng chính hãng giúp lông chó mèo bóng mượt và khử mùi hôi hiệu quả, đồng thời lưu giữ hương thơm cho pet cưng của bạn.</p>\r\n</div>'),(705,75,0,237,'<p><strong>Dầu thơm thú cưng Bioline</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Công nghệ châu Âu (Đức)</li>\r\n<li>Dung tích 207ml</li>\r\n<li>Có 3 mùi: Love Letter, Chance, Cologne</li>\r\n<li>Tác dụng: Dưỡng lông, khử mùi hôi nhanh chóng và tạo hương thơm tự nhiên.</li>\r\n<li>Cách dùng: Xịt 1 lần đối với thú nhỏ, 2-3 lần đối với thú lớn</li>\r\n</ul>'),(706,85,0,237,'Dầu thơm thú cưng Bioline 207ml'),(707,76,0,237,'<p>Dầu thơm thú cưng Bioline với công nghệ sản xuất châu Âu (Đức) giúp nhanh chóng khử mùi hôi trên chó mèo, tạo hương thơm tự nhiên.</p>'),(708,75,0,238,'<p><strong>Dầu thơm thú cưng Bioline</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Công nghệ châu Âu (Đức)</li>\r\n<li>Dung tích 207ml</li>\r\n<li>Có 3 mùi: Love Letter, Chance, Cologne</li>\r\n<li>Tác dụng: Dưỡng lông, khử mùi hôi nhanh chóng và tạo hương thơm tự nhiên.</li>\r\n<li>Cách dùng: Xịt 1 lần đối với thú nhỏ, 2-3 lần đối với thú lớn</li>\r\n</ul>'),(709,85,0,238,'Dầu thơm thú cưng Bioline 207ml'),(710,76,0,238,'<p>Dầu thơm thú cưng Bioline với công nghệ sản xuất châu Âu (Đức) giúp nhanh chóng khử mùi hôi trên chó mèo, tạo hương thơm tự nhiên.</p>'),(711,75,0,239,'<p><strong>Dầu thơm thú cưng Bioline</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Công nghệ châu Âu (Đức)</li>\r\n<li>Dung tích 207ml</li>\r\n<li>Có 3 mùi: Love Letter, Chance, Cologne</li>\r\n<li>Tác dụng: Dưỡng lông, khử mùi hôi nhanh chóng và tạo hương thơm tự nhiên.</li>\r\n<li>Cách dùng: Xịt 1 lần đối với thú nhỏ, 2-3 lần đối với thú lớn</li>\r\n</ul>'),(712,85,0,239,'Dầu thơm thú cưng Bioline 207ml'),(713,76,0,239,'<p>Dầu thơm thú cưng Bioline với công nghệ sản xuất châu Âu (Đức) giúp nhanh chóng khử mùi hôi trên chó mèo, tạo hương thơm tự nhiên.</p>'),(714,75,0,240,'<p><strong>Dầu thơm thú cưng Bioline</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Công nghệ châu Âu (Đức)</li>\r\n<li>Dung tích 207ml</li>\r\n<li>Có 3 mùi: Love Letter, Chance, Cologne</li>\r\n<li>Tác dụng: Dưỡng lông, khử mùi hôi nhanh chóng và tạo hương thơm tự nhiên.</li>\r\n<li>Cách dùng: Xịt 1 lần đối với thú nhỏ, 2-3 lần đối với thú lớn</li>\r\n</ul>'),(715,85,0,240,'Dầu thơm thú cưng Bioline 207ml'),(716,76,0,240,'<p>Dầu thơm thú cưng Bioline với công nghệ sản xuất châu Âu (Đức) giúp nhanh chóng khử mùi hôi trên chó mèo, tạo hương thơm tự nhiên.</p>'),(717,75,0,241,'<p><strong>Xịt khử mùi chó mèo Bioline Peach Blossom</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Công nghệ châu Âu (Đức)</li>\r\n<li>Dung tích 118ml</li>\r\n<li>Mùi hoa đào nhẹ nhàng, dễ chịu và có tác dựng khử khuẩn</li>\r\n<li>Dùng xịt lên lông thú cưng, xịt vào chuồng, lồng, nệm, khu vực cần khử mùi hôi</li>\r\n<li>Dùng được cho cả chó và mèo</li>\r\n</ul>'),(718,85,0,241,'Xịt khử mùi chó mèo Bioline'),(719,76,0,241,'<p>Xịt khử mùi chó mèo Bioline có tác dụng như nước hoa, khử mùi hôi của thú cưng hiệu quả.</p>'),(720,75,0,242,'<p><strong>Xịt khử mùi, dưỡng lông cho chó BUDLE</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Dung tích: 530ml</li>\r\n<li>Hương Lavender</li>\r\n<li>Dành cho mọi loại chó</li>\r\n</ul>\r\n<h4><strong>Đặc điểm nổi bật </strong></h4>\r\n<p>Xịt khử mùi dưỡng lông Lavender thuộc dòng sản phẩm hương xịt khử mùi dưỡng lông cho chó. Công thức từ lá trà xanh và cây mê điệt, kết hợp với thảo dược có nguồn gốc từ phương Đông, đã tạo nên hương hoa tự nhiên, thơm dịu, giúp cún giảm stress. Bên cạnh đó, sản phẩm còn dưỡng lông và da, phục hồi hư tổn, xơ rối, cho thú cưng bộ lông óng mượt.</p>\r\n<ul>\r\n<li>Xịt khử mùi dưỡng lông dành cho mọi giống chó</li>\r\n<li>Hương thơm: hoa oải hương</li>\r\n<li>Công thức hoàn hảo với chiết xuất hữu cơ thiên nhiên</li>\r\n<li>Tinh chất trà xanh hữu cơ, mê điệt, hạt jojoba, hoa cúc...</li>\r\n<li>Khắc phục bộ lông hư tổn, xơ rối</li>\r\n<li>Khử mùi hôi cơ thể thú cưng một cách hiệu quả</li>\r\n<li>Hương thơm thư thái dễ chịu làm cho thú cưng luôn sảng khoái</li>\r\n</ul>\r\n<h4> </h4>\r\n<p> </p>\r\n<p><strong>Thành phần hữu cơ tự nhiên, không hương liệu hóa học, tốt cho sức khỏe</strong></p>\r\n<p>Sản phẩm là sự kết hợp từ các thành phần tự nhiên với hương thơm đặc trưng từ loài hoa oải hương – lavender. Sản phẩm còn được khuyên dùng trong trường hợp thú cưng không có khả năng tắm rửa vệ sinh thường xuyên.</p>\r\n<p>Ngoài khả năng khử mùi hiệu quả, Xịt khử mùi dưỡng lông hương Lavender còn có tác dụng dưỡng lông và da, giúp bộ lông thú cưng luôn được bóng mượt không xơ rối, đem lại cảm giác thoải mái và sạch sẽ để cún yêu của bạn tự tin vui đùa suốt ngày dài.</p>\r\n<p><strong>Ý nghĩa hương Lavender - Oải hương: sự tinh tế, bình yên, thư thái</strong></p>\r\n<p>Oải hương giúp cún cảm thấy thư giãn, bình yên, giảm căng thẳng, và còn có tác dụng tăng cường miễn dịch, tăng tuần hoàn máu và chống muỗi nữa. Dùng xịt khử mùi dưỡng lông hương oải hương Lavender sẽ mang lại hương thơm dịu nhẹ sảng khoái cho ngôi nhà của bạn.</p>'),(721,85,0,242,'Xịt khử mùi, dưỡng lông cho chó BUDLE'),(722,76,0,242,'<p>Xịt khử mùi, dưỡng lông cho chó BUDLE hương Lavender với công thức từ lá trà xanh và cây mê điệt, kết hợp với thảo dược có nguồn gốc từ phương Đông, đã tạo nên hương hoa tự nhiên, thơm dịu, giúp cún giảm stress.</p>'),(723,75,0,243,'<p><strong>Nước hoa cho chó mèo ENOUG</strong></p>\r\n<ul>\r\n<li>Thú cưng cũng cần nước hoa giống như con người chúng ta</li>\r\n<li>Mùi nước hoa giúp thú cưng trở nên sạch sẽ, dễ gần hơn</li>\r\n<li>Xua tan mùi khó chịu vốn có của lông chó mèo</li>\r\n<li>Tạo ấn tượng với mọi người khi tiếp xúc thú cưng của bạn</li>\r\n<li>Dung tích 50ml sử dụng được khoảng 12 - 18 tháng</li>\r\n<li>Có 4 mùi hương khác nhau, lưu ý khi đặt hàng</li>\r\n</ul>'),(724,85,0,243,'Nước hoa cho chó mèo ENOUG'),(725,76,0,243,'<p>Nước hoa cho chó mèo ENOUG với 4 mùi hương khác nhau, giúp thú cưng xua tan mùi hôi, kết nối sen và boss gần nhau hơn.</p>'),(726,75,0,244,'<p><strong>Xịt dưỡng lông cho chó mèo Tropiclean (Mỹ)</strong></p>\r\n<p> </p>\r\n<p>Công thức 100% từ thiên nhiên, giúp da thú cưng chống tia UV từ ánh sáng mặt trời, tránh phai màu lông. Bột yến mạch đồng thời làm lông mềm, mịn và giữ mùi hương dễ chịu.</p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Mỹ</li>\r\n<li>Dung tích: 236ml</li>\r\n<li>Mùi hương: Dưa leo</li>\r\n<li>Dùng cho chó mèo mọi lứa tuổi</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>Cách dùng:</strong> Xịt trực tiếp lên lông thú cưng, tránh xịt vào mắt.</p>'),(727,85,0,244,'Xịt dưỡng lông cho chó mèo Tropiclean (Mỹ)'),(728,76,0,244,'<p>Xịt dưỡng lông cho chó mèo Tropiclean là thương hiệu đến từ Mỹ, sản phẩm chứa công thức chống tia UV đặc biệt giúp bộ lông của bé luôn mềm mượt, mát mẻ và hương thơm dễ chịu.</p>'),(729,75,0,245,'<p><strong>Kem đánh răng khô cho chó BUDLE</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Khối lượng: 80 gram</li>\r\n<li>Dùng cho mọi loại chó, mọi lứa tuổi</li>\r\n</ul>\r\n<h4><strong>Đặc điểm nổi bật</strong></h4>\r\n<p>Kem đánh răng khô Budle’Budle thuộc dòng sản phẩm chăm sóc răng miệng cho thú cưng. Kem đánh răng khô được làm từ thảo mộc hữu cơ là trà xanh và mê điệt, có tác dụng hiệu quả trong việc vệ sinh khoang miệng, kháng viêm và tăng cường sức khỏe răng miệng.</p>\r\n<ul>\r\n<li>Kem đánh răng dùng cho mọi giống chó thuộc mọi lứa tuổi, cân nặng</li>\r\n<li>Chiết xuất trà xanh hữu cơ và cây mê điệt hữu cơ được chứng nhận ECOCERT</li>\r\n<li>Hương vị caramel ngọt ngào và sảng khoái với các chú chó</li>\r\n<li>Công thức loại bỏ mảng bám và sự hình thành vôi răng mạnh mẽ</li>\r\n<li>Phòng chống các bệnh về nướu, giảm stress cho cún hiệu quả</li>\r\n<li>Giảm thiểu mùi hôi miệng, cho hơi thở cún luôn thơm mát dễ chịu</li>\r\n<li>Dùng được cho cả chó và mèo. Không cần xả lại với nước</li>\r\n</ul>\r\n<h4> </h4>\r\n<p><strong>Bảo vệ răng miệng thú cưng toàn diện</strong></p>\r\n<p>Sản phẩm được kết hợp từ những thành phần tự nhiên đã qua tuyển chọn kỹ càng. Thú cưng của bạn sẽ có được hàm răng trắng sáng, khỏe mạnh mà không cần bất kỳ sản phẩm hỗ trợ nào.</p>\r\n<p><strong>Kem khô độc đáo và tiện dụng</strong></p>\r\n<p>Không cần bàn chải, cũng không cần rửa lại với nước, Kem đánh răng khô hoạt động nhanh và vô cùng hiệu quả trong việc làm giảm các mảng bám đồng thời hạn chế sự hình thành vôi răng, một cách dễ dàng, hiệu quả và tiện lợi.</p>\r\n<p><strong>Thành phần hữu cơ tự nhiên, tuyệt đối an toàn và tốt cho sức khỏe</strong></p>\r\n<p>Công thức độc đáo từ nha đam, Vitamin B6 và Chitosan giúp tăng cường sức khỏe cho nướu và giữ hơi thở luôn thơm mát chỉ với một bước đơn giản. Sau khi thú cưng của bạn ngủ dậy, sau khi ăn hoặc bất cứ khi nào miệng có mùi hôi, bạn lấy một lượng vừa đủ kem và bôi lên hàm răng của thú cưng, động tác nhai của thú cưng sẽ thay cho việc chải răng. Đối với vật nuôi nhỏ hơn, đặc biệt là mèo, có thể cần thêm sự hổ trợ từ ngón tay hoặc tăm bông.</p>'),(730,85,0,245,'Kem đánh răng khô cho chó BUDLE'),(731,76,0,245,'<div class=\"desc wb-content\">\r\n<p>Kem đánh răng khô cho chó BUDLE không cần dùng bàn chải, không cần nước, được làm từ thảo mộc hữu cơ là trà xanh và mê điệt, có tác dụng hiệu quả trong việc vệ sinh khoang miệng, kháng viêm và tăng cường sức khỏe răng miệng.</p>\r\n</div>'),(732,75,0,246,'<p><strong>Nước vệ sinh tai chó mèo Oxymed Tropilcean</strong></p>\r\n<ul>\r\n<li><strong>Xuất xứ: Mỹ</strong></li>\r\n<li>Dung tích: 118 ml</li>\r\n<li>Thành phần 100% từ thiên nhiên: Nước, Propylene Glycol, Alpha-Hydroxy, Boric Acid, Isopropyl Alcohol, Salicylic Acid, Acetic Acid, chất khử mùi.</li>\r\n<li>Sản phẩm có công thức đặc biệt không cay, loại bỏ ráy tai và giảm mùi hôi ở tai của thú cưng một cách rõ rệt, nhanh chóng.</li>\r\n<li>Sử dụng thường xuyên giúp duy trì tai của thú cưng luôn sạch sẽ.</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>Hướng dẫn sử dụng:</strong></p>\r\n<ul>\r\n<li>Lắc đều trước khi sử dụng. Nhỏ vào tai vật nuôi, xoa nhẹ nhàng phần tai, vành tai và làm sạch với bông gòn. Sử dụng 2-3 lần/tuần, giúp giữ cho tai sạch sẽ và giảm mùi hôi.</li>\r\n<li>Không sử dụng trên vết thương hở, vùng da bị trầy xước.</li>\r\n<li>Bảo quản: Nơi thoáng mát, khô ráo, tránh ánh sáng trực tiếp, nhiệt độ phòng.</li>\r\n<li>Để xa tầm tay trẻ em.</li>\r\n</ul>'),(733,85,0,246,'Nước vệ sinh tai chó mèo Oxymed Tropiclean (Mỹ)'),(734,76,0,246,'<p>Nước vệ sinh tai chó mèo Oxymed Tropiclean nhập khẩu Mỹ là sản phẩm có công thức độc quyền, giúp loại bỏ nhanh chóng ráy tai và giảm mùi hôi xuất phát từ tai thú cưng hiệu quả.</p>'),(735,75,0,247,'<p><strong>Xịt vệ sinh răng miệng chó, khử mùi hôi miệng Tropiclean</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Mỹ</li>\r\n<li>Dung tích: 118ml</li>\r\n<li>Dùng cho chó mọi lứa tuổi</li>\r\n</ul>\r\n<p> </p>\r\n<p>Sản phẩm dạng xịt, giúp vật nuôi có hơi thở thơm mát một cách nhanh chóng mà không cần phải đánh răng. Hiệu quả rõ rệt ngay sau khi sử dụng.</p>\r\n<p><strong>Cách dùng: </strong>Xịt 1 lần trực tiếp vào miệng thú cưng, có thể lặp lại nếu cần.</p>\r\n<p>Vì sao bạn nên dùng xịt vệ sinh răng miệng chó, khử mùi hôi miệng Tropiclean?</p>\r\n<ul>\r\n<li>Giúp thú cưng có hơi thở thơm mát ngay lập tức.</li>\r\n<li>Thành phần 100% từ thiên nhiên đảm bảo an toàn cho sức khỏe của thú cưng và chính bạn.</li>\r\n<li>Là giải pháp độc quyền lần đầu tiên trên thế giới làm sạch răng miệng cho thú cưng không cần dùng bàn chải</li>\r\n<li>Bạn chỉ cần tốn 1-2 phút mỗi ngày cho sức khỏe thú cưng của bạn</li>\r\n<li>Sản phẩm của Mỹ, kiểm định nghiêm ngặt về chất lượng</li>\r\n<li>Giúp cho nước bọt của chó luôn sạch sẽ không lây bệnh sang cho bạn và người thân của bạn</li>\r\n</ul>'),(736,85,0,247,'Xịt vệ sinh răng miệng chó, khử mùi hôi miệng Tropiclean'),(737,76,0,247,'<p>Xịt vệ sinh răng miệng chó, khử mùi hôi miệng Tropiclean giúp cún cưng có hơi thở thơm mát một cách nhanh chóng mà không cần phải đánh răng.</p>'),(738,75,0,248,'<p><strong>Nước uống chăm sóc răng miệng chó mèo Bioline</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Công nghệ Đức</li>\r\n<li>Dung tích 300ml</li>\r\n<li>Dùng được cho chó và mèo từ 2 tháng tuổi</li>\r\n<li>Thành phần chiết xuất từ thiên nhiên, loại bỏ mùi hôi và các nguyên nhân gây ra mùi hôi miệng ở thú cưng.</li>\r\n<li>Hỗ trợ men răng, làm trắng răng, giúp răng chắc khỏe</li>\r\n<li>Giúp bảo vệ nướu khỏi các bệnh viêm nhiễm, nha chu</li>\r\n<li>Tạo hơi thở thơm mát tức thì</li>\r\n<li>Loại bỏ mảng bám và cao răng</li>\r\n<li>Thay thế phương pháp đánh răng</li>\r\n</ul>\r\n<p>Cách dùng:</p>\r\n<ul>\r\n<li>Pha 1 nắp đầy Bioline Dental Water vào 250ml nước uống hằng ngày của thú cưng.</li>\r\n<li>Dũng mỗi ngày để đạt hiệu quả tốt nhất.</li>\r\n</ul>'),(739,85,0,248,'Nước uống chăm sóc răng miệng chó mèo Bioline'),(740,76,0,248,'<p>Nước uống chăm sóc răng miệng chó mèo Bioline giúp khử mùi hôi miệng, ngăn ngừa mảng bám cao răng, hỗ trợ men răng phát triển khỏe mạnh.</p>'),(741,75,0,249,'<p><strong>Nước uống vệ sinh răng miệng cho mèo Tropiclean</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Mỹ</li>\r\n<li>Dung tích: 473ml</li>\r\n<li>Dùng cho mèo mọi lứa tuổi</li>\r\n<li>Thành phần: Nước tinh khiết, glycerin đậu nành &amp; hạt cải, rượu ngô, trà xanh, bạc hà khoáng chất &amp; dinh dưỡng tự nhiên</li>\r\n</ul>\r\n<p>Nước chăm sóc răng miệng hằng ngày cho mèo. Sản phẩm không mùi không vị, sử dụng đơn giản bằng cách hòa vào nước uống của vật nuôi, giúp ngăn ngừa mảng bám và giữ cho hơi thở thơm mát trong vòng 12 giờ, mà không cần chải răng cho thú cưng.Hiệu quả thấy rõ từ 7-10 ngày.</p>\r\n<p><strong>Cách dùng:</strong> Hòa 1 nắp đầy dung dịch sản phẩm vào nửa lít nước uống của thú cưng mỗi khi bạn thay nước mới. Khi vật nuôi uống nước cũng đồng nghĩa với việc chúng đang tự làm sạch răng miệng của mình.</p>\r\n<p><strong>Vì sao bạn nên dùng nước uống vệ sinh răng miệng cho mèo Tropiclean?</strong></p>\r\n<ul>\r\n<li>Thành phần 100% từ thiên nhiên đảm bảo an toàn cho sức khỏe của thú cưng và chính bạn.</li>\r\n<li>Là giải pháp độc quyền lần đầu tiên trên thế giới làm sạch răng miệng cho thú cưng không cần dùng bàn chải</li>\r\n<li>Bạn chỉ cần tốn 1-2 phút mỗi ngày cho sức khỏe thú cưng của bạn.</li>\r\n<li>Giúp hơi thở cún cưng luôn thơm mát.</li>\r\n<li>Ngăn ngừa hình thành mảng bám, cao răng ố vàng.</li>\r\n<li>Giúp cho nước bọt của chó luôn sạch sẽ không lây bệnh sang cho bạn và người thân của bạn. </li>\r\n<li>Hỗ trợ điều trị một số bệnh về răng nướu.</li>\r\n<li>Sản phẩm của Mỹ, kiểm định nghiêm ngặt về chất lượng</li>\r\n</ul>'),(742,85,0,249,'Nước uống vệ sinh răng miệng cho mèo Tropiclean'),(743,76,0,249,'<div class=\"desc wb-content\">\r\n<p><strong>Nước uống vệ sinh răng miệng cho mèo Tropiclean</strong> không mùi không vị, sử dụng đơn giản bằng cách hòa vào nước uống của vật nuôi, giúp ngăn ngừa mảng bám và giữ cho hơi thở thơm mát trong vòng 12 giờ mà không cần chải răng cho thú cưng.</p>\r\n</div>'),(744,75,0,250,'<p><strong>Sữa làm trắng lông ố vàng thương hiệu Tropiclean</strong></p>\r\n<p>Chó mèo có bộ lông trắng tinh nhưng lại bị ố vàng ngay khóe mắt làm mất đi vẻ đẹp hoàn hảo, điều này làm bạn lo lắng rất nhiều phải không? Giải pháp cho bạn là đây:</p>\r\n<ul>\r\n<li>Thương hiệu nổi tiếng: Tropiclean, nhập khẩu Mỹ</li>\r\n<li>Dung tích: 236 ml</li>\r\n<li>Dùng cho chó mèo mọi lứa tuổi</li>\r\n<li>Sản phẩm 100% từ thiên nhiên, an toàn cho vùng da nhạy cảm gần mắt, <strong>không gây kích ứng mắt, không chứa chất tẩy trắng như các sản phẩm giá rẻ</strong></li>\r\n<li>Giúp lông ố vàng ngày càng trắng sáng hơn một cách tự nhiên</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>Hướng dẫn sử dụng:</strong></p>\r\n<ul>\r\n<li>Làm ướt lông vùng ố vàng, lấy một ít sữa thoa vùng lông bị ố trên mặt bé, xoa đều cho sữa thấm vào lông khoảng 2-3 phút, rửa lại bằng nước sạch, tránh chạm vào vào mắt.</li>\r\n<li>Thích hợp khi tắm cho bé gần xong, bạn kết hợp rửa mặt này</li>\r\n<li>Nếu sản phẩm dính vào mắt, lấy nước sạch rửa lại cho thú cưng.</li>\r\n</ul>'),(745,85,0,250,'Sữa làm trắng lông ố vàng (Loại rửa lông mặt)'),(746,76,0,250,'<p>Sữa làm trắng lông ố vàng thương hiệu Tropiclean cao cấp nhập khẩu Mỹ. Sản phẩm dạng sữa dùng rửa mặt cho các vùng lông ở khóe mắt chó mèo bị ố vàng do nước mắt, ghèn...</p>'),(747,75,0,251,'<p><strong>Khăn vệ sinh mắt chó mèo SOS</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Loại khăn ướt mềm, dễ dàng vệ sinh vùng mắt cho thú cưng</li>\r\n<li>Chứa chiết xuất nha đam từ thiên nhiên, nhẹ nhàng làm sạch bụi bẩn</li>\r\n<li>Dạng hộp, 100 miếng</li>\r\n</ul>'),(748,85,0,251,'Khăn vệ sinh mắt chó mèo SOS'),(749,76,0,251,'<div class=\"desc wb-content\">\r\n<p>Khăn vệ sinh mắt chó mèo SOS dạng mềm ướt, chứa chiết xuất nha đam, nhẹ nhàng làm sạch vùng mắt cho thú cưng.</p>\r\n</div>'),(750,75,0,252,'<p><strong>Nước vệ sinh mắt cho mèo Lee&amp;Webster</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Dung tích: 130ml</li>\r\n<li>Dành cho mèo mọi lứa tuổi</li>\r\n</ul>\r\n<h4><strong>Đặc điểm nổi bật </strong></h4>\r\n<p>Dung dịch vệ sinh mắt cho mèo Lee&amp;Webster thuộc dòng sản phẩm vệ sinh - chăm sóc sức khỏe cho mèo, giúp loại bỏ những mảng ghèn khó chịu, làm cho đôi mắt chú mèo của bạn sạch sẽ nhanh chóng. Không những thế, dung dịch còn giúp miễn dịch cho mắt và đem lại mùi hương thơm nhẹ nhàng tự nhiên làm cho thú cưng của bạn sảng khoái và thích thú.</p>\r\n<ul>\r\n<li>Dung dịch vệ sinh mắt dành riêng cho các chú mèo</li>\r\n<li>Thành phần hữu cơ thiên nhiên: mê điệt, trà xanh, lá sơn trà, tía tô...</li>\r\n<li>Hiệu quả tối ưu trong việc chống oxy hoá</li>\r\n<li>Ức chế sự phát triển của vi khuẩn có hại, ngăn ngừa đổ ghèn</li>\r\n<li>Cho đôi mắt chú mèo luôn khoẻ mạnh</li>\r\n<li>Tăng cường miễn dịch cho mắt</li>\r\n<li>Cho mèo luôn có cảm giác thoái mái, dễ chịu</li>\r\n</ul>\r\n<h4> </h4>\r\n<p> </p>\r\n<p><strong>Công thức đặc biệt từ thiên nhiên loại bỏ chất nhầy xung quanh mắt</strong></p>\r\n<p>Dung dịch vệ sinh mắt dành cho mèo Lee&amp;Webster với sự kết hợp từ các thành phần nguyên liệu tự nhiên và thảo dược có tác dụng nổi bật trong việc loại bỏ các vết nhầy xung quanh mắt, làm sạch vết bẩn khó coi trên mắt một cách an toàn và dịu nhẹ.</p>\r\n<p><strong>Chống oxy hóa, ức chế vi khuẩn có hại, ngăn ngừa đổ ghèn</strong></p>\r\n<p>Thành phần trà xanh và mê điệt hiệu quả tối ưu trong việc chống oxy hóa, ức chế sự phát triển của các vi khuẩn có hại, ngăn đổ ghèn trở lại mà không lo bị biến đổi màu lông, cho đôi mắt chú mèo luôn khỏe mạnh.</p>'),(751,85,0,252,'Nước vệ sinh mắt cho mèo Lee&Webster'),(752,76,0,252,'<div class=\"desc wb-content\">\r\n<p>Nước vệ sinh mắt cho mèo Lee&amp;Webster giúp loại bỏ những mảng ghèn khó chịu, làm cho đôi mắt chú mèo của bạn sạch sẽ nhanh chóng.</p>\r\n</div>'),(753,75,0,253,'<p><strong>Thuốc nhỏ mắt cho chó BUDLE</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: Hàn Quốc</li>\r\n<li>Dung tích: 120ml</li>\r\n<li>Dùng cho chó mọi lứa tuổi</li>\r\n</ul>\r\n<h4><strong>Đặc điểm nổi bật </strong></h4>\r\n<p>Dung dịch nhỏ mắt cho chó Budle’Budle thuộc dòng sản phẩm vệ sinh- chăm sóc sức khỏe cho chó. Chiết xuất từ trà xanh và mê điệt hữu cơ đặc biệt hiệu quả trong việc làm sạch bụi bẩn, phòng ngừa các bệnh về mắt như đau mắt, viêm giác mạc… cho đôi mắt cún luôn trong sáng tinh anh.</p>\r\n<ul>\r\n<li>Điều trị bệnh viêm mắt, đau mắt, khô mắt</li>\r\n<li>Vệ sinh mắt, loại bỏ hết bụi bẩn và diệt khuẩn cho mắt</li>\r\n<li>Dung dịch nhỏ mắt dùng cho mọi giống chó, mọi lứa tuổi</li>\r\n<li>Ngăn ngừa viêm giác mạc và các bệnh liên quan đến mắt</li>\r\n<li>Cung cấp dưỡng chất giúp đôi mắt sáng khỏe</li>\r\n<li>Chiết xuất thảo dược Đông y, hoàn toàn không gây kích ứng</li>\r\n<li>Chiết xuất trà xanh hữu cơ và cây mê điệt hữu cơ được chứng nhận ECOCERT</li>\r\n</ul>\r\n<h4> </h4>\r\n<p><strong>Thành phần hữu cơ tự nhiên, an toàn và tốt cho sức khỏe thú cưng của bạn</strong></p>\r\n<p>Sản phẩm giúp cho đôi mắt thú cưng của bạn tránh khỏi những vết viêm nhiễm và luôn sáng khỏe. Dung dịch nhỏ mắt còn giúp ngăn ngừa các chứng bệnh liên quan đến mắt, loại bỏ bụi bẩn và diệt khuẩn một cách hiệu quả cho thú cưng. Thành phần trà xanh giúp kháng khuẩn, giảm mẩn ngứa, loại bỏ mùi hôi khó chịu.</p>\r\n<p>Sản phẩm được sản xuất theo công thức đặc biệt với sự kết hợp độc đáo từ các thành phần tự nhiên. Trà xanh hữu cơ giúp kháng khuẩn tối ưu, loại bỏ bụi bẩn, cho đôi mắt thú cưng, cung cấp dưỡng chất giúp nuôi dưỡng đôi mắt luôn sạch sẽ và sáng khỏe tinh anh, giảm mỏi mắt, khô mắt, mờ mắt.</p>'),(754,85,0,253,'Thuốc nhỏ mắt cho chó BUDLE'),(755,76,0,253,'<p>Thuốc nhỏ mắt cho chó BUDLE làm sạch bụi bẩn, phòng ngừa các bệnh về mắt như đau mắt, viêm giác mạc… cho đôi mắt cún luôn trong sáng tinh anh.</p>'),(756,75,0,254,'<p><strong>Lồng mèo di động trong suốt hình tròn</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Thiết kế mang đến sự thoải mái cho mèo khi ở bên trong</li>\r\n<li>Kiểu dáng thời trang, sang trọng</li>\r\n<li>Bảo vệ an toàn cho mèo cưng cùng những chuyến đi</li>\r\n<li>Có nệm lót êm ái bên trong</li>\r\n<li>Lưới thoáng khí, dễ chịu</li>\r\n<li>Kính trong suốt giúp mèo dễ quan sát môi trường bên ngoài, cũng như giúp bạn dễ dàng theo dõi mèo cưng</li>\r\n</ul>'),(757,85,0,254,'Lồng mèo di động trong suốt hình tròn'),(758,76,0,254,'<div class=\"desc wb-content\">\r\n<p>Lồng mèo di động trong suốt hình tròn giúp bạn dễ dàng mang mèo cưng của mình theo những chuyến đi, thiết kế an toàn, thoải mái hơn so với balo và túi xách.</p>\r\n</div>'),(759,75,0,255,'<p><strong>Lồng mèo di động trong suốt hình tròn</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Thiết kế mang đến sự thoải mái cho mèo khi ở bên trong</li>\r\n<li>Kiểu dáng thời trang, sang trọng</li>\r\n<li>Bảo vệ an toàn cho mèo cưng cùng những chuyến đi</li>\r\n<li>Có nệm lót êm ái bên trong</li>\r\n<li>Lưới thoáng khí, dễ chịu</li>\r\n<li>Kính trong suốt giúp mèo dễ quan sát môi trường bên ngoài, cũng như giúp bạn dễ dàng theo dõi mèo cưng</li>\r\n</ul>'),(760,85,0,255,'Lồng mèo di động trong suốt hình tròn'),(761,76,0,255,'<div class=\"desc wb-content\">\r\n<p>Lồng mèo di động trong suốt hình tròn giúp bạn dễ dàng mang mèo cưng của mình theo những chuyến đi, thiết kế an toàn, thoải mái hơn so với balo và túi xách.</p>\r\n</div>'),(762,75,0,256,'<p><strong>Lồng mèo di động trong suốt hình tròn</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Thiết kế mang đến sự thoải mái cho mèo khi ở bên trong</li>\r\n<li>Kiểu dáng thời trang, sang trọng</li>\r\n<li>Bảo vệ an toàn cho mèo cưng cùng những chuyến đi</li>\r\n<li>Có nệm lót êm ái bên trong</li>\r\n<li>Lưới thoáng khí, dễ chịu</li>\r\n<li>Kính trong suốt giúp mèo dễ quan sát môi trường bên ngoài, cũng như giúp bạn dễ dàng theo dõi mèo cưng</li>\r\n</ul>'),(763,85,0,256,'Lồng mèo di động trong suốt hình tròn'),(764,76,0,256,'<div class=\"desc wb-content\">\r\n<p>Lồng mèo di động trong suốt hình tròn giúp b